INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここに困ってる人は\nいないよね…？\nよかった♪", 1, 1, 1, 100101, 1);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "冒険の準備準備…\nうん、忘れ物はなし！\n…あっ！", 1, 1, 2, 100101, 2);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 1, 1, 3, 100101, 3);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここで特訓していい？\n物は壊さないように\n気をつけるね！", 1, 1, 4, 100101, 4);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なんか落ち着かないや\nもしかして、\n困ってる人が\n近くにいるのかな…？", 1, 1, 5, 100101, 5);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "えへへ…いつも\n一緒にいてくれて\nありがとねっ！", 1, 1, 101, 100101, 6);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 1, 1, 102, 100101, 7);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あははっ！\nやったなー！\nお返しだー！\nこちょこちょこちょ…", 1, 2, 1, 100101, 8);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうしたの？\nもしかして困ってる？\nあたしにまかせて！", 1, 2, 2, 100101, 9);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "えっとね…しっぽは\n触っちゃダメだよ？", 1, 2, 3, 100101, 10);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 1, 2, 4, 100101, 11);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ふぁふぃ？\nやられた～！　ほっぺ\nぷにぷにしないでぇ～", 1, 2, 101, 100101, 12);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 1, 2, 102, 100101, 13);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよー！\n今日も元気に\nいっちゃうよー！", 1, 2, 1, 100101, 14);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 1, 2, 2, 100101, 15);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 1, 2, 3, 100101, 16);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちゃんとケアして\n傷が残らないように\nしないと…", 1, 3, 1, 100101, 17);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一回休むと\nこのままずるずる\nいきそう…", 1, 3, 2, 100101, 18);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 1, 3, 3, 100101, 19);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "落ち着くなぁ～\n心だけじゃなくて\n体もほぐれそう♪", 1, 3, 4, 100101, 20);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったかい所に\nいると体が丸く\nなっちゃう…", 1, 3, 5, 100101, 21);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いつ何が起きるか\n分からないし、\nもっと力をつけないと", 1, 3, 6, 100101, 22);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美味しいけど、\n食べ過ぎないように\nしないと…！！", 1, 3, 7, 100101, 23);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "文字が多いと\n眠くなっちゃう…\n危ない危ない！", 1, 3, 8, 100101, 24);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 1, 1, 1, 100102, 26);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "のんびりするのって\n退屈かも…\n何かして遊ばない？", 1, 1, 2, 100102, 27);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "留守番はちょっと\n苦手かも…\nなんか寂しいんだもん", 1, 1, 3, 100102, 28);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたしのお友達も\n呼んできていい？\nきっと楽しいよ！", 1, 1, 4, 100102, 29);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "誰も困ってないよね？\n…何をすれば\nいいのか分かんないや", 1, 1, 5, 100102, 30);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 1, 1, 101, 100102, 31);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "…なんであたし\n騎士くんばっかり\n見てるんだろ…", 1, 1, 102, 100102, 32);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 1, 2, 1, 100102, 33);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "触るのって楽しい？\n…そっか\n少しだけだよ…？", 1, 2, 2, 100102, 34);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたしの元気を\nわけてあげるね！\nフレー！　フレー！", 1, 2, 3, 100102, 35);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何かムズムズする！？\nって騎士くんかぁー\nどしたの？", 1, 2, 4, 100102, 36);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ひゃうっ！　もう…\nしっぽはだめだってば\n次やったらデコピン！", 1, 2, 101, 100102, 37);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 1, 2, 102, 100102, 38);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝ごはんと運動！\nこれがあたしの\n元気の素だよ！", 1, 2, 1, 100102, 39);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 1, 2, 2, 100102, 40);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 1, 2, 3, 100102, 41);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これでよし♪\n騎士くん\n気づくかな…？", 1, 3, 1, 100102, 42);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一回休むと\nこのままずるずる\nいきそう…", 1, 3, 2, 100102, 43);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 1, 3, 3, 100102, 44);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういうの\nなんか気になって\nじーって見ちゃうんだ", 1, 3, 4, 100102, 45);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったかい所に\nいると体が丸く\nなっちゃう…", 1, 3, 5, 100102, 46);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いつ何が起きるか\n分からないし\nもっと力をつけないと", 1, 3, 6, 100102, 47);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お腹が減ると\nなんか力が\n出ないんだよね…", 1, 3, 7, 100102, 48);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "色んなことを\n知っておくのは\n大事だよね！", 1, 3, 8, 100102, 49);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お片付けも済んだし\n今度は洗濯ものを\nたたもうかな", 1, 1, 1, 100201, 51);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 1, 1, 2, 100201, 52);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 1, 1, 3, 100201, 53);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "戦いは\n得意じゃないけど\nお料理なら…！", 1, 1, 4, 100201, 54);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういう平和な\n時間が、もっと\n続くといいな", 1, 1, 5, 100201, 55);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "わたし…\nもうちょっとだけ勇気\n出してみようかな", 1, 1, 101, 100201, 56);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "みんなのことが大好き\nも、もちろん、\n騎士クンのことも…\nな、仲間として！", 1, 1, 102, 100201, 57);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ひゃうっ！\nな、なに？\nびっくりしたぁ…", 1, 2, 1, 100201, 58);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "男の子って、\nやっぱりおっきいね。\nその…手とか\n他にもいろいろ…", 1, 2, 2, 100201, 59);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "困ったことが\nあったら\nいつでも話してね", 1, 2, 3, 100201, 60);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "え！　む、虫っ！？\n取って取って！\nはやく～！", 1, 2, 4, 100201, 61);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あのね…\n一緒におでかけ\nしたいんだけど…\nダメかな？", 1, 2, 101, 100201, 62);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 1, 2, 102, 100201, 63);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "お、おはよう！\nあの…朝ごはんは\nもう食べちゃった？", 1, 2, 1, 100201, 64);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼休みだね\nあの…良かったら\nお弁当…食べない？", 1, 2, 2, 100201, 65);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "遅くまでお疲れ様\n明日も頑張ろうね\nふわぁ…", 1, 2, 3, 100201, 66);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "よし…\nこれなら\n褒めてもらえるかな？", 1, 3, 1, 100201, 67);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "がんばることも\n必要だけど、\nお休みも大切だよね", 1, 3, 2, 100201, 68);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいいなぁ…\nわたしも今度\n作ってみよう。\nえっと、材料は…", 1, 3, 3, 100201, 69);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "戦う前にもこうやって\n落ち着けたら\nいいのに", 1, 3, 4, 100201, 70);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…はへっ？\nも、もしかして今\n寝ちゃってた…？", 1, 3, 5, 100201, 71);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 1, 3, 6, 100201, 72);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしいものって\n食べ過ぎちゃうけど…\nしょうがない…よね？", 1, 3, 7, 100201, 73);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…そっか\nこうすれば魔法が\nもっと強くなるんだ", 1, 3, 8, 100201, 74);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "洗濯と掃除\nどっちから\nはじめよう？", 1, 1, 1, 100202, 76);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新しい魔道書を\n買いに行かなくちゃ\nもっとたくさん\n魔法を覚えたいな", 1, 1, 2, 100202, 77);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 1, 1, 3, 100202, 78);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日はどんな料理に\n挑戦しよう…♪", 1, 1, 4, 100202, 79);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 1, 1, 5, 100202, 80);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "みんなのことが大好き\nも、もちろん\n騎士クンのことも…\nな、仲間として！", 1, 1, 101, 100202, 81);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "騎士クンのそばに\nいられるだけで\n幸せだよ", 1, 1, 102, 100202, 82);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "えっと、その…\nこんな所で\nこういうことされると\n恥ずかしいよ…", 1, 2, 1, 100202, 83);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "え！　む、虫っ！？\n取って取って！\nはやく～！", 1, 2, 2, 100202, 84);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、あの…実は\n騎士クンのこと…\nううん、やっぱり\nなんでもない", 1, 2, 3, 100202, 85);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "男の子って\nやっぱりおっきいね\nその…手とか\n他にもいろいろ…", 1, 2, 4, 100202, 86);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 1, 2, 101, 100202, 87);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ふふふっ…そんなとこ\nツンツンしないで\nくすぐったいよ～", 1, 2, 102, 100202, 88);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう\nよく眠れた？　今日も\n一日、頑張ろうね♪", 1, 2, 1, 100202, 89);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お腹空いちゃった…\nそうだ。騎士クンも\n一緒にお昼食べない？", 1, 2, 2, 100202, 90);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "もうこんな時間…\nそろそろ寝なくちゃ\nおやすみなさい", 1, 2, 3, 100202, 91);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "よし…\nこれなら\n褒めてもらえるかな？", 1, 3, 1, 100202, 92);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "がんばることも\n必要だけど\nお休みも大切だよね", 1, 3, 2, 100202, 93);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい～♪\n騎士クンは\nこういうのって好き？", 1, 3, 3, 100202, 94);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "戦う前にもこうやって\n落ち着けたら\nいいのに", 1, 3, 4, 100202, 95);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの…！\nよ、良かったら\n一緒に…！", 1, 3, 5, 100202, 96);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 1, 3, 6, 100202, 97);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近服のサイズが\n合わないんだけど…\n食べ過ぎなのかな？", 1, 3, 7, 100202, 98);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…やっぱり\n月刊恋愛指南は\nためになる…", 1, 3, 8, 100202, 99);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "装備の手入れでも\nしようかな…", 1, 1, 1, 100301, 101);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "次に鍛えるべきは\n肉体面か精神面か\nどちらにしよう…？", 1, 1, 2, 100301, 102);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 1, 1, 3, 100301, 103);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仲間なんていらない\nそう思ってた頃も\nあったな…", 1, 1, 4, 100301, 104);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "考えごとをしていると\nつい部屋中を\n歩いてしまうな", 1, 1, 5, 100301, 105);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "彼は\nどこまで強くなるのか\n私も負けられないな", 1, 1, 101, 100301, 106);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 1, 1, 102, 100301, 107);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ああ、キミだったのか\n人の気配がしたから\n誰かと思ったよ", 1, 2, 1, 100301, 108);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "斬りかかるつもりなら\nちゃんとかかってきて\n…呼んだだけ？", 1, 2, 2, 100301, 109);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なに？　私に相談？\n戦いについてなら\n喜んで", 1, 2, 3, 100301, 110);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今のが突き？\n軽い！　もっと鋭く！\nさあ、もう一回！", 1, 2, 4, 100301, 111);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ひゃっ！　ど、どこを\n触ってるの！？\n…油断した", 1, 2, 101, 100301, 112);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 1, 2, 102, 100301, 113);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう\n今日も充実した\n一日にしていこう", 1, 2, 1, 100301, 114);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "そろそろ\nお茶の時間か\nキミも一緒にどう？", 1, 2, 2, 100301, 115);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 1, 2, 3, 100301, 116);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "戦いを経てもなお\n美しくあるように…\nこれでよし♪", 1, 3, 1, 100301, 117);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "戦ってばかりで\n休まないと、また\nユイに怒られるな", 1, 3, 2, 100301, 118);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 1, 3, 3, 100301, 119);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これはいい…\n戦いの前の精神統一に\nもってこいじゃないか", 1, 3, 4, 100301, 120);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "時々は落ち着いた\n時間を過ごすのも\n悪くない…", 1, 3, 5, 100301, 121);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 1, 3, 6, 100301, 122);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "食事は大切だけど\n食べ過ぎには\n注意しておこう…", 1, 3, 7, 100301, 123);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 1, 3, 8, 100301, 124);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "海だけじゃなくて\n川でも釣りがしたいな\n道具も新調しよう", 1, 1, 1, 100302, 126);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 1, 1, 2, 100302, 127);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "彼は\nどこまで強くなるのか\n私も負けられないな", 1, 1, 3, 100302, 128);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ修行の\n内容を新しくしよう\nより厳しいものにね", 1, 1, 4, 100302, 129);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "強くなって…誰にも\n妨げられない自由な\n生き方がしたい", 1, 1, 5, 100302, 130);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "まさか風邪を引くとは\n彼の看病のおかげで\nすっかり良く\nなったけど", 1, 1, 101, 100302, 131);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 1, 1, 102, 100302, 132);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうしたの？\nなんでもない？\nそれなら良かった", 1, 2, 1, 100302, 133);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんまり突っつくと\nお返しするよ？\n覚悟は出来てる？", 1, 2, 2, 100302, 134);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねぇ、今度また\n釣りに行かない？\n大きいのを狙おう", 1, 2, 3, 100302, 135);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "修行がしたいの？\nそれを早く言ってよ\nすぐに出発しよう！", 1, 2, 4, 100302, 136);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ひょっとして\n今のも一本だなんて\n言わないよね？", 1, 2, 101, 100302, 137);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 1, 2, 102, 100302, 138);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今日は仕事？\nそれとも修行？\n良ければ付き合うよ", 1, 2, 1, 100302, 139);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "休息も時には\n必要だと、仲間から\n教わったよ", 1, 2, 2, 100302, 140);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 1, 2, 3, 100302, 141);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "髪の長さを少し\n変えてみようかな…\nわ、私は何を…！", 1, 3, 1, 100302, 142);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "休息があってこそ\n万全な状態で\n戦えるんだ", 1, 3, 2, 100302, 143);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 1, 3, 3, 100302, 144);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体と同様に\n心もほぐれるね…\nはぁ…", 1, 3, 4, 100302, 145);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "休む時は休む\nヒヨリもそろそろ\n覚えて欲しいな…", 1, 3, 5, 100302, 146);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 1, 3, 6, 100302, 147);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "修行のせいか\n最近食べる量が\n増えてきたような…", 1, 3, 7, 100302, 148);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 1, 3, 8, 100302, 149);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1, 1, 1, 100401, 151);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "落とし穴…どこに\n作ったんだっけ？", 1, 1, 2, 100401, 152);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 1, 1, 3, 100401, 153);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 1, 1, 4, 100401, 154);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かくれんぼする人\nこの指、と～まれ！", 1, 1, 5, 100401, 155);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ミソギ以外の人に\nイタズラされちゃ\nダメだよ！", 1, 1, 101, 100401, 156);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ミソギと遊ぶ？\nミソギに遊ばれる？", 1, 1, 102, 100401, 157);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいこと思いついた！\nい、イタズラとかじゃ\nないよ～", 1, 2, 1, 100401, 158);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うわっ！？\n　にいちゃんが、\nミソギにイタズラ？", 1, 2, 2, 100401, 159);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にいちゃんの\n通りそうなところに\nバナナの皮を…", 1, 2, 3, 100401, 160);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 1, 2, 4, 100401, 161);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ここ、ミソギ探検隊の\n基地にしようよ！", 1, 2, 101, 100401, 162);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 1, 2, 102, 100401, 163);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "にいちゃん、おはよ！\n目覚まし時計を\n止めておいたのに、\nよく起きられたね～♪", 1, 2, 1, 100401, 164);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "にいちゃんが\n昼寝したら、\nイタズラし放題♪", 1, 2, 2, 100401, 165);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 1, 2, 3, 100401, 166);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "イタズラには\nお色気も必要…\nうん、完璧！", 1, 3, 1, 100401, 167);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "座ったら、ブーッって\nいう音が出たら、\nおもしろいな～♪", 1, 3, 2, 100401, 168);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 1, 3, 3, 100401, 169);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 1, 3, 4, 100401, 170);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 1, 3, 5, 100401, 171);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "探検家は\n体力勝負だよー！", 1, 3, 6, 100401, 172);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "みんなに分けて\nあげようかな～\n激辛ソースも\n入れちゃうけどね！", 1, 3, 7, 100401, 173);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういう所に\n宝の地図が\n隠れてるんだよね～", 1, 3, 8, 100401, 174);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1, 1, 1, 100402, 176);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うぅ、探検に出たい！\nじっとしてなんか\nいられないよ～！", 1, 1, 2, 100402, 177);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 1, 1, 3, 100402, 178);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 1, 1, 4, 100402, 179);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かくれんぼする人\nこの指、と～まれ！", 1, 1, 5, 100402, 180);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 1, 1, 101, 100402, 181);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "にいちゃんが喜ぶ\nイタズラ、何かない\nかな～？", 1, 1, 102, 100402, 182);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミソギがしかけた\nイタズラ\n見つけられるかな？", 1, 2, 1, 100402, 183);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "探検する？\n冒険する？\nそれとも…\nイタズラされる？", 1, 2, 2, 100402, 184);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "将来の夢は探検家！\n探したい物はないけど", 1, 2, 3, 100402, 185);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にいちゃんに宿題！\n落とし穴を10個\n掘ること！", 1, 2, 4, 100402, 186);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 1, 2, 101, 100402, 187);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ここ、ミソギ探検隊の\n基地にしようよ！", 1, 2, 102, 100402, 188);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "にいちゃん\n探検に行こうよ！\n今からなら遭難しても\n夜には帰れるよ！", 1, 2, 1, 100402, 189);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "にいちゃんが昼寝したら\nイタズラし放題♪", 1, 2, 2, 100402, 190);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 1, 2, 3, 100402, 191);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "イタズラには\nお色気も必要…\nうん、完璧！", 1, 3, 1, 100402, 192);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ゆっくりまったりして\n次のイタズラを\n考えよ～！", 1, 3, 2, 100402, 193);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 1, 3, 3, 100402, 194);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 1, 3, 4, 100402, 195);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 1, 3, 5, 100402, 196);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "探検家は\n体力勝負だよー！", 1, 3, 6, 100402, 197);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "探検のおやつに\nぴったりかも～！", 1, 3, 7, 100402, 198);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういう所に\n宝の地図が\n隠れてるんだよね～", 1, 3, 8, 100402, 199);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "音楽は全部好きだけど\n一番好きなのは\nやっぱりジャズかな", 1, 1, 1, 100601, 201);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ、はぁ…\n一人でもいっぱい\nしないと…\n特訓…", 1, 1, 2, 100601, 202);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姉ちゃんには\nもっと自信を\n持ってほしいなぁ", 1, 1, 3, 100601, 203);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姉ちゃんのマネ\nしちゃおうかな？", 1, 1, 4, 100601, 204);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "双子って、\n好みのタイプも\n似ちゃうのかな？", 1, 1, 5, 100601, 205);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "お兄ちゃんと私は\n相性抜群です♪", 1, 1, 101, 100601, 206);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 1, 1, 102, 100601, 207);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 1, 2, 1, 100601, 208);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うふふ、お兄ちゃん！\n今日は何を\nするんですか？", 1, 2, 2, 100601, 209);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そんなところ\n触っちゃダメ♪", 1, 2, 3, 100601, 210);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お兄ちゃん、イジワル\nしないでください…", 1, 2, 4, 100601, 211);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "お兄ちゃん、もっと\n上級編のテクニック、\n教えてくださいね！", 1, 2, 101, 100601, 212);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "コーチ、\n今日も特訓\nお願いします！", 1, 2, 102, 100601, 213);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 1, 2, 1, 100601, 214);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "こんな明るい時間から\nす、するんですか…\n二人っきりの特訓…", 1, 2, 2, 100601, 215);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜はこれからですよ\nお兄ちゃん♪", 1, 2, 3, 100601, 216);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "世界一、かわいく\nなるんだから♪", 1, 3, 1, 100601, 217);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "気持ちいい♪\nもう立てないよ～", 1, 3, 2, 100601, 218);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\nアカリのライバル\nだね", 1, 3, 3, 100601, 219);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 1, 3, 4, 100601, 220);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ…アカリ、\nとろけちゃう…", 1, 3, 5, 100601, 221);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ…はぁはぁ、\n私…もう…ダメ\n限界です…！", 1, 3, 6, 100601, 222);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "わぁ、おいしい～\nけど食べ過ぎは美容に\nよくないですよね", 1, 3, 7, 100601, 223);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この楽譜、\nサックスで吹いて\nみたいなぁ♪", 1, 3, 8, 100601, 224);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このごろ一人でいると\nお兄ちゃんのこと\nばかり考えちゃう…", 1, 1, 1, 100602, 226);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ、はぁ…もっと\nいっぱいしなくちゃ\n…練習", 1, 1, 2, 100602, 227);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このお部屋、なんだか\n落ち着きます…\nお兄ちゃんが\nいるから？", 1, 1, 3, 100602, 228);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "みんなかわいいな～\n世界一かわいくなる\nのは、難しいな…", 1, 1, 4, 100602, 229);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "双子って、\n好みのタイプも\n似ちゃうのかな？", 1, 1, 5, 100602, 230);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "いつか世界でいちばん\nかわいくなって\nお兄ちゃんと…", 1, 1, 101, 100602, 231);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 1, 1, 102, 100602, 232);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 1, 2, 1, 100602, 233);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "二人きりの秘密の特訓\n今度はいつですか？\n待ち遠しいです…", 1, 2, 2, 100602, 234);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "え？　ここでするの？\nみんなの前で恥ずか\nしいな…筋トレ", 1, 2, 3, 100602, 235);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お兄ちゃん、イジワル\nしないでください…", 1, 2, 4, 100602, 236);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お兄ちゃんといると\nわ、私…ドキドキ\nしてきちゃう…", 1, 2, 101, 100602, 237);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "コーチ、\n今日も特訓\nお願いします！", 1, 2, 102, 100602, 238);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 1, 2, 1, 100602, 239);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お兄ちゃんに\n食べてもらいたいなぁ\n手作りのお昼ごはん", 1, 2, 2, 100602, 240);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お風呂入ってきますね\nそのあとは…\n二人でい～っぱい\n遊びましょうね", 1, 2, 3, 100602, 241);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姉ちゃんのマネ\nしちゃおうかな？", 1, 3, 1, 100602, 242);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "気持ちいい♪\nもう立てないよ～", 1, 3, 2, 100602, 243);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\nアカリのライバル\nだね", 1, 3, 3, 100602, 244);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 1, 3, 4, 100602, 245);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったか～い…\nまるでお兄ちゃんが\n隣にいる時みたい", 1, 3, 5, 100602, 246);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "汗をかくと\n気持ちいいですよね", 1, 3, 6, 100602, 247);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お兄ちゃんの特訓に\n付き合うために\nたっぷり\n食べておかないと♪", 1, 3, 7, 100602, 248);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この楽譜\nサックスで吹いて\nみたいなぁ♪", 1, 3, 8, 100602, 249);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "プリン、プリン、\nプリン、プリン、\nプリン、プリン～♪", 1, 1, 1, 100701, 251);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "う～ら～め～し～や～\nなの～♪", 1, 1, 2, 100701, 252);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～", 1, 1, 3, 100701, 253);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "幽霊の正体見たり、\nミヤコなの～", 1, 1, 4, 100701, 254);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミヤコがいきなり\n消えたら、みんな\n驚くかもなの～♪", 1, 1, 5, 100701, 255);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "アイツがいて、\nプリンもある。\nきっとここが天国なの", 1, 1, 101, 100701, 256);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 1, 1, 102, 100701, 257);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "姿を消して、オマエを\n見張ってやるの～\nむふふ～♪", 1, 2, 1, 100701, 258);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 1, 2, 2, 100701, 259);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 1, 2, 3, 100701, 260);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 1, 2, 4, 100701, 261);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "たくさんオマエと\n遊べて、\n成仏しそうなくらい\nうれしいの～！", 1, 2, 101, 100701, 262);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "オマエのこと\n気に入ったからずっと\nとり憑いてやるの～", 1, 2, 102, 100701, 263);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "う～　眠いの…\n二度目の二度寝を\nするの…", 1, 2, 1, 100701, 264);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼ご飯はプリンなの\n３時のおやつも、\nプリンなの～", 1, 2, 2, 100701, 265);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ディナーは豪華に、\nプリンのフルコース\nなの～♪", 1, 2, 3, 100701, 266);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体が透けちゃうから\nうまく使えないの～", 1, 3, 1, 100701, 267);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "まったりなの～\nあとはプリンがあれば\n完璧なの～", 1, 3, 2, 100701, 268);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "む～…かわいいけど\nプリンは分けて\nあげないの～", 1, 3, 3, 100701, 269);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "は～　いい気分なの…\n成仏しそうなの…", 1, 3, 4, 100701, 270);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？", 1, 3, 5, 100701, 271);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "幽霊には、体力も\n筋力も関係ないの～！", 1, 3, 6, 100701, 272);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぱくぱくモグモグ…\nミヤコ、幽霊だけど、\nお腹はすくの～", 1, 3, 7, 100701, 273);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "プリンの写真集が\nあればいいのに\nなの～", 1, 3, 8, 100701, 274);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うらめしや～…\n裏の飯より\nプリンがいいの～", 1, 1, 1, 100702, 276);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "プリン♪　プリン♪\nプリン♪　なの～♪　", 1, 1, 2, 100702, 277);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "世界中のケーキ屋が\nプリンのおいしさを\n競い合えばいいの～！\n審査員はミヤコなの～", 1, 1, 3, 100702, 278);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "買ってきたプリンには\n全部ミヤコの名前を\n書いておくの～", 1, 1, 4, 100702, 279);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～ ", 1, 1, 5, 100702, 280);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "アイツがいて\nプリンもある\nきっとここが天国なの", 1, 1, 101, 100702, 281);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 1, 1, 102, 100702, 282);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 1, 2, 1, 100702, 283);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 1, 2, 2, 100702, 284);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日はオマエと\nプリンを買いに行くの\n強制なの～　", 1, 2, 3, 100702, 285);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 1, 2, 4, 100702, 286);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "たくさんオマエと\n遊べて\n成仏しそうなくらい\nうれしいの～！ ", 1, 2, 101, 100702, 287);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ミヤコのプリン\nオマエにだったら\n分けてあげるの～ ", 1, 2, 102, 100702, 288);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "う～　眠いの…\n二度目の二度寝を\nするの… ", 1, 2, 1, 100702, 289);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "う～ら～め～し～や～\n…明るい時間だと\n驚かせないの～ ", 1, 2, 2, 100702, 290);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ひゅ～どろどろ～ん☆\n真っ暗なうちに\nいたずらしまくるの～♪", 1, 2, 3, 100702, 291);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体が透けちゃうから\nうまく使えないの～ ", 1, 3, 1, 100702, 292);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "落ち着くの～\nいまプリン食べたら\nきっといつもより\nおいしいの～♪ ", 1, 3, 2, 100702, 293);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "む～…かわいいけど\nプリンは分けて\nあげないの～　", 1, 3, 3, 100702, 294);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "は～　いい気分なの…\n成仏しそうなの…", 1, 3, 4, 100702, 295);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？ ", 1, 3, 5, 100702, 296);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "幽霊には、体力も\n筋力も関係ないの～！　", 1, 3, 6, 100702, 297);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしいの～\nプリン味だったら\nもっとおいしいの～ ", 1, 3, 7, 100702, 298);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "プリンの写真集が\nあればいいのに\nなの～ ", 1, 3, 8, 100702, 299);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もし太陽が滅んでも\nボクの美しさで大地を\n照らしてあげる！", 1, 1, 1, 100801, 301);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 1, 1, 2, 100801, 302);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 1, 1, 3, 100801, 303);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 1, 1, 4, 100801, 304);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うわっ昨日より可愛く\nなってる。明日は\nどうなっちゃう\nのかな？", 1, 1, 5, 100801, 305);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "このボクがいるだけで\nあの人への\nおもてなしだよね", 1, 1, 101, 100801, 306);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ボクの可愛さは、\nふふ…あの人の\nためのものさ", 1, 1, 102, 100801, 307);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねぇ～、ボクって\n可愛い？\nふふ、知ってる☆", 1, 2, 1, 100801, 308);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 1, 2, 2, 100801, 309);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふふ、ボクに触ると\nキミも美しく\nなっちゃうかもよ？", 1, 2, 3, 100801, 310);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうかな、\n今日のボク。\n美しい？　可愛い？\nねえ、どっち？", 1, 2, 4, 100801, 311);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あの人も今、\n可愛いボクのこと\n考えてるかな…", 1, 2, 101, 100801, 312);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "美しい…\nキミの瞳に写るボクは\nより一層きれいだ", 1, 2, 102, 100801, 313);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "美しいボクの\n美しい一日が\n始まるよ！", 1, 2, 1, 100801, 314);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "さーて、午後からも\n可愛く美しく\n華麗に優雅に♪", 1, 2, 2, 100801, 315);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "バラの花びら\nいっぱい浮かべた\nお風呂に入ってから\n寝ようっと♪", 1, 2, 3, 100801, 316);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 1, 3, 1, 100801, 317);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 1, 3, 2, 100801, 318);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "わあ、可愛い！\n…まあ、ボクほど\nじゃないけどさ！", 1, 3, 3, 100801, 319);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 1, 3, 4, 100801, 320);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "気安く触ったら\n火傷する…\n炎はボクに似ているね", 1, 3, 5, 100801, 321);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 1, 3, 6, 100801, 322);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクが食べると、\n食べ物まで\n可愛いなあ…", 1, 3, 7, 100801, 323);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクが触った瞬間に、\nこの本は美を\n携えてしまうんだ", 1, 3, 8, 100801, 324);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクの美しさは\nみんなのために\nあるんだよ！", 1, 1, 1, 100802, 326);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 1, 1, 2, 100802, 327);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ以上美しくなると\nボクをめぐって\n大陸中で戦争が\n始まっちゃう！", 1, 1, 3, 100802, 328);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 1, 1, 4, 100802, 329);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクの可愛さについて\nみんな話し合わない\nのかな…？", 1, 1, 5, 100802, 330);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "このボクがいるだけで\nあの人への\nおもてなしだよね", 1, 1, 101, 100802, 331);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あの人も今\n可愛いボクのこと\n考えてるかな…", 1, 1, 102, 100802, 332);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 1, 2, 1, 100802, 333);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクの美しさに嫉妬\nしたって意味ないよね\n次元が違うんだから", 1, 2, 2, 100802, 334);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクの化粧品使う？\n一緒に可愛くなろうよ", 1, 2, 3, 100802, 335);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクがいるだけで\nこの部屋は美の神殿♪\nランドソルの新たな\n観光名所になるね！", 1, 2, 4, 100802, 336);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 1, 2, 101, 100802, 337);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "美しい…\nキミの瞳に写るボクは\nより一層綺麗だ", 1, 2, 102, 100802, 338);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝日と共に\nボクの美しさも\n周りを照らすよ", 1, 2, 1, 100802, 339);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ボクの美しさを\n維持するために\nお昼ご飯食べなくちゃ", 1, 2, 2, 100802, 340);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "バラの花びらいっぱい\n浮かべたお風呂に\n入ってから\n寝ようっと♪", 1, 2, 3, 100802, 341);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 1, 3, 1, 100802, 342);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 1, 3, 2, 100802, 343);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "可愛いものを\n可愛いって言える\nボクって可愛いよね！", 1, 3, 3, 100802, 344);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 1, 3, 4, 100802, 345);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "冷えは美容の大敵\nなんだから！\nここ、ボクの場所ね！", 1, 3, 5, 100802, 346);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 1, 3, 6, 100802, 347);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクが食べると\n食べ物まで\n可愛いなあ…", 1, 3, 7, 100802, 348);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ボクが触った瞬間に\nこの本は美を\n携えてしまうんだ", 1, 3, 8, 100802, 349);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「第１０部２０章\n終焉戦争、開幕」\n…これでよし！", 1, 1, 1, 100901, 351);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今度シグルドに\n私の魔法を一つ\n伝授してやるか", 1, 1, 2, 100901, 352);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここでは風が\n吹いてこないな…\n換気したい！", 1, 1, 3, 100901, 353);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 1, 1, 4, 100901, 354);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "まずは包帯をとって\n手から龍の形の\n炎を出して…", 1, 1, 5, 100901, 355);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "シグルド…\n今頃何処で何を\nしているのだろう…", 1, 1, 101, 100901, 356);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "最近、彼の姿が\nまぶしく見える…\nどうして…？", 1, 1, 102, 100901, 357);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "辞書を知らないか？\n…探している\n理由は聞くな", 1, 2, 1, 100901, 358);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そうだ！\n貴様の技にも\n名前をつけてやろう！", 1, 2, 2, 100901, 359);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私に触れても力を\n奪われないのは\n貴様くらいだぞ？", 1, 2, 3, 100901, 360);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何事だ？\nまさか我が瞳に\n魅入られたのか？", 1, 2, 4, 100901, 361);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 1, 2, 101, 100901, 362);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 1, 2, 102, 100901, 363);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "「覚醒」めたか…\n行くぞ、悪を討つ\n戦いに出発だ！", 1, 2, 1, 100901, 364);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "昼間は「ヤツら」も\n襲ってはこない…\n束の間の休息だ", 1, 2, 2, 100901, 365);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "どうした？　夜はまだ\nこれから…ふぁ…\nね、眠くなどないぞ！", 1, 2, 3, 100901, 366);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 1, 3, 1, 100901, 367);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "くっ…！\n私を眠りの国へ\n誘うつもりか！", 1, 3, 2, 100901, 368);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このようなものに\n懐柔されるものか！\n…されるものか！", 1, 3, 3, 100901, 369);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 1, 3, 4, 100901, 370);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これが我らの求めた\n安寧か…\n悪くない…", 1, 3, 5, 100901, 371);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この程度\n前世での激闘に\n比べれば…！", 1, 3, 6, 100901, 372);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近金欠でな…\nいやぁありがたい…", 1, 3, 7, 100901, 373);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここにも\n前世の記憶が\n眠っていたとは…", 1, 3, 8, 100901, 374);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「第１３部１章\n閃光のシグルド」\n…ついに登場だな", 1, 1, 1, 100902, 376);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何故だ…何故\nこうもあっさり金欠に\n逆戻りするのだ！？", 1, 1, 2, 100902, 377);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "やはり転生者という\n設定はカッコイイ…\n天才だな、私！", 1, 1, 3, 100902, 378);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 1, 1, 4, 100902, 379);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ今日の分の\n魔力を溜めないと\nまた魔力切れが…", 1, 1, 5, 100902, 380);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近奴がそばに\nいるだけで、鼓動が\n早くなるのは何故だ？", 1, 1, 101, 100902, 381);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "シ、シグルド…！\nだめだ…妄想でも\n上手く言えない…", 1, 1, 102, 100902, 382);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "なんだ？　新たな\n賞金の情報を\n持ってきたのか？", 1, 2, 1, 100902, 383);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "名乗りやポーズは\nその強度で相手を\n圧倒する技術だ", 1, 2, 2, 100902, 384);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいか、魔法の\n詠唱中は絶対に\n声をかけるなよ？", 1, 2, 3, 100902, 385);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おお、ちょうど今\n貴様専用の設定集を\n作成中だぞ！", 1, 2, 4, 100902, 386);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 1, 2, 101, 100902, 387);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 1, 2, 102, 100902, 388);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 1, "夜更かしのせいか\nまだ眠気が…いや！\nこれは組織の罠だ！", 1, 2, 1, 100902, 389);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "平穏な時に\n出来るだけ魔力を\n溜めておかねば…", 1, 2, 2, 100902, 390);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜になると、力が\n増した気分になるな\n…なりませんか？", 1, 2, 3, 100902, 391);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 1, 3, 1, 100902, 392);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お、おのれ\nヒュプノス…\n私は負けないぞ…", 1, 3, 2, 100902, 393);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "くっくっくっ…\n貴様は特別団員に\nしてやろう", 1, 3, 3, 100902, 394);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 1, 3, 4, 100902, 395);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これが我らの求めた\n安寧か…\n悪くない…", 1, 3, 5, 100902, 396);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新たな戦いに備えて\n魔力だけでなく\n体力も鍛えねば！", 1, 3, 6, 100902, 397);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "食事は魔力に\n変換する体力の\n元になるのだ！", 1, 3, 7, 100902, 398);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "フフフ…\nこれを覚えれば\nもっと強く…！", 1, 3, 8, 100902, 399);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんほんまに\nはんなりしてて、\n王子はんって感じやわ", 1, 1, 1, 101001, 401);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この絵本の王子はん、\n王子はんみたいで\nええなぁ♪", 1, 1, 2, 101001, 402);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 1, 1, 3, 101001, 403);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 1, 1, 4, 101001, 404);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんのために\n糸を紡いで、\n編み物でもしまひょか", 1, 1, 5, 101001, 405);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "マホ姫と王子はん、\n絵本の世界より\nベストカップルや", 1, 1, 101, 101001, 406);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 1, 1, 102, 101001, 407);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 1, 2, 1, 101001, 408);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 1, 2, 2, 101001, 409);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんは、\n絵本から出てきた人\nみたいやね～", 1, 2, 3, 101001, 410);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちの話し方\nのんびりしてます\nやろか？", 1, 2, 4, 101001, 411);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "マホ姫の手は\nつべたいから、\n王子はんが温めて？", 1, 2, 101, 101001, 412);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 1, 2, 102, 101001, 413);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 1, 2, 1, 101001, 414);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お茶請けはお大福が\nよろしおすけど\nクッキーもええなあ", 1, 2, 2, 101001, 415);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "うち、普段から\n夢見がちやけど…\nほんに眠い時間やわぁ", 1, 2, 3, 101001, 416);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんに\n会いに行くなら、\nおめかしせな\nあかんなぁ", 1, 3, 1, 101001, 417);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はんなりした\nええお椅子やわぁ\nほっこりしますなあ", 1, 3, 2, 101001, 418);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かいらしもんが\nいっぱいで、\nマホマホ王国みたい\nやわぁ", 1, 3, 3, 101001, 419);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "心地ええどす。まるで\nお花畑にいるようやね", 1, 3, 4, 101001, 420);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぽかぽかどす。\n心まであったかく\nなりますわぁ", 1, 3, 5, 101001, 421);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁはぁ、お姫はんは\n激しい運動は\nしぃひんもんどす～", 1, 3, 6, 101001, 422);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…あんまり\n速う食べられへんけど\n美味しいわぁ", 1, 3, 7, 101001, 423);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "絵本、絵本～\n幸せやわぁ♪", 1, 3, 8, 101001, 424);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんにとって\n自慢の姫になるえ～", 1, 1, 1, 101002, 426);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "カボチャの馬車に\nガラスの靴…\n欲しいなぁ", 1, 1, 2, 101002, 427);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 1, 1, 3, 101002, 428);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 1, 1, 4, 101002, 429);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ほんまなぁ\nこの絵本が面白いんよ\n王子はんに\n読んであげよ", 1, 1, 5, 101002, 430);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "マホ姫と王子はん\n絵本の世界より\nベストカップルや", 1, 1, 101, 101002, 431);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 1, 1, 102, 101002, 432);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "たまには、王子はんの\n好きな絵本も\n知りたいな～", 1, 2, 1, 101002, 433);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 1, 2, 2, 101002, 434);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そのうち、王子はんの\nお国にも連れてって\nもらえますやろか？", 1, 2, 3, 101002, 435);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "絵本読むんも\nええなぁ…", 1, 2, 4, 101002, 436);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 1, 2, 101, 101002, 437);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 1, 2, 102, 101002, 438);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 1, 2, 1, 101002, 439);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "マホマホ王国では\nこの時分は\nみんなお昼寝\nしてたんよ", 1, 2, 2, 101002, 440);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜に飛んだり鳴いたり\nする鳥はんもおるんよ\n昼は寝てはるんかねぇ", 1, 2, 3, 101002, 441);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんに\n会いに行くなら\nおめかしせな\nあかんなぁ", 1, 3, 1, 101002, 442);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "王子はんも一緒に\nゆっくりしていっても\nええんよ？", 1, 3, 2, 101002, 443);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かいらしい子やねぇ\nうちとお友だちに\nなってくれるん？", 1, 3, 3, 101002, 444);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "癒しアイテムって\nほんま、好っきゃわぁ", 1, 3, 4, 101002, 445);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちのお城にも\nほしいわぁ。帰ったら\nさっそく準備せな\nあかんなぁ", 1, 3, 5, 101002, 446);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋の中で運動\nできるのも、なかなか\n面白いもんやわぁ", 1, 3, 6, 101002, 447);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいひいわ～\nマホマホ王国には\nない味やわぁ", 1, 3, 7, 101002, 448);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "しっかり知識を\n身につけんと\n魔法も使えへん\nからなぁ", 1, 3, 8, 101002, 449);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 1, 1, 1, 101101, 451);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おやつのケーキは\n苺かチョコ…\nどっちも食べよう！", 1, 1, 2, 101101, 452);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "い、いけない！\n縫い針落としちゃった", 1, 1, 3, 101101, 453);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ケーキをクレープで\n巻いたら…\n大ヒット商品の予感！", 1, 1, 4, 101101, 454);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 1, 1, 5, 101101, 455);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 1, 1, 101, 101101, 456);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ここがお兄ちゃんの\n部屋…\nドキドキしちゃう～", 1, 1, 102, 101101, 457);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねぇ、おにいちゃん\n一緒に、スイーツでも\n食べにいかない？", 1, 2, 1, 101101, 458);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 1, 2, 2, 101101, 459);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "勉強、見てくれるん\nですか？　やった～♪", 1, 2, 3, 101101, 460);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "服がほつれてますよ？\n直してあげます！", 1, 2, 4, 101101, 461);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "私をお嫁さんに\nしたいなら、予約は\nお早目に、ですよ♪", 1, 2, 101, 101101, 462);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ねぇねぇお兄ちゃん！\n…えへへ、\n呼んでみただけ♪", 1, 2, 102, 101101, 463);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 1, 2, 1, 101101, 464);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼休憩に\n甘いものが\n食べたいです～", 1, 2, 2, 101101, 465);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ねむいです～\nでももうちょっと\n勉強しないと～…", 1, 2, 3, 101101, 466);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この服、かわいい♪\n今度作って\nみよっと～！", 1, 3, 1, 101101, 467);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "勉強で疲れたから\n休憩しよ～っと", 1, 3, 2, 101101, 468);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\n私が服を作って\nあげよっか？", 1, 3, 3, 101101, 469);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リラックスできます～\nお兄ちゃんが隣に\nいるみたい！", 1, 3, 4, 101101, 470);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "のんびりしたら、\nまた勉強しよっと！", 1, 3, 5, 101101, 471);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動すると勉強も\nはかどるよね！", 1, 3, 6, 101101, 472);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 1, 3, 7, 101101, 473);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お兄ちゃんの記憶を\n戻す方法、どこかに\n書いてないかな？", 1, 3, 8, 101101, 474);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ケーキの食べ過ぎで\nお腹が…うぅ、\n因果横暴だよー…", 1, 1, 1, 101102, 476);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 1, 1, 2, 101102, 477);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "い、いけない！\n縫い針落としちゃった", 1, 1, 3, 101102, 478);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "笑う時には服着ます！", 1, 1, 4, 101102, 479);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 1, 1, 5, 101102, 480);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 1, 1, 101, 101102, 481);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お兄ちゃんが帰って\nきたら、何して遊ぼう\nかな～？", 1, 1, 102, 101102, 482);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "勉強、見てくれるん\nですか？　やった～♪", 1, 2, 1, 101102, 483);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 1, 2, 2, 101102, 484);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おにいちゃん！\nそろそろ、おやつに\nしませんか？", 1, 2, 3, 101102, 485);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "勉強は…\n明日にしようっと", 1, 2, 4, 101102, 486);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "妹だけど、大人な\nレディですからね！", 1, 2, 101, 101102, 487);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "な、ナデナデとか\n恥ずかしいな～", 1, 2, 102, 101102, 488);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 1, 2, 1, 101102, 489);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼休憩に\n甘いものが\n食べたいです～", 1, 2, 2, 101102, 490);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お兄ちゃんは\n夜強いんですね\n私は眠くて…", 1, 2, 3, 101102, 491);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "服装や髪形が変わると\n気分も変わるよね", 1, 3, 1, 101102, 492);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここで寝ちゃったら\n受験勉強が～…\nぐーー", 1, 3, 2, 101102, 493);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\n私が服を作って\nあげよっか？", 1, 3, 3, 101102, 494);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いまならどんな試験も\n合格できそうです！", 1, 3, 4, 101102, 495);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "のんびりしたら\nまた勉強しよっと！", 1, 3, 5, 101102, 496);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お兄ちゃんを\n守るためには\n毎日、鍛えなくちゃ！", 1, 3, 6, 101102, 497);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 1, 3, 7, 101102, 498);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この本の服\nかわいいなぁ♪\n私に作れるかな？", 1, 3, 8, 101102, 499);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1, 1, 1, 101201, 501);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "たくさん寝すぎて、\n夢の中か現実か\nわかんなく\nなっちゃうんだよね～", 1, 1, 2, 101201, 502);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…はっ！？\nね、寝てないよ？\nホントだよっ", 1, 1, 3, 101201, 503);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 1, 1, 4, 101201, 504);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もし、超能力のことが\nバレたら…ブルブル", 1, 1, 5, 101201, 505);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "テレパシーで\nキミの心を覗けたら\n…なんてね！", 1, 1, 101, 101201, 506);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミを抱き枕に…\nじょ、冗談冗談！", 1, 1, 102, 101201, 507);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん～、なになに？\n一緒にお昼寝する？", 1, 2, 1, 101201, 508);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "忘れ物しちゃった。\nま、いっか！\nえ、ダメ？", 1, 2, 2, 101201, 509);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おおっ、相談ごと？\nなにかな\nなにかな～？", 1, 2, 3, 101201, 510);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "う～ん、もしかして\nキミにも仲良しになる\n超能力があるのかも！", 1, 2, 4, 101201, 511);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 1, 2, 101, 101201, 512);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "えっ？　私とキミとの\n相性？　むむ～…\nうん、バッチリだよ☆", 1, 2, 102, 101201, 513);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "まだこんな時間？\nベッドに行って、\n二度寝しなくちゃ～", 1, 2, 1, 101201, 514);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 1, 2, 2, 101201, 515);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "どんなにお昼寝しても\n夜は眠いんだ～", 1, 2, 3, 101201, 516);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 1, 3, 1, 101201, 517);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 1, 3, 2, 101201, 518);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ…可愛い！\nシオリンに\n届けてあげたい！", 1, 3, 3, 101201, 519);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 1, 3, 4, 101201, 520);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "気持ちいい…\nはっ！　ダメダメ！\nまた寝るとこだった！", 1, 3, 5, 101201, 521);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "眠くならないように、\n運動しよっと！", 1, 3, 6, 101201, 522);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お腹いっぱいになると\n眠くなるよね～", 1, 3, 7, 101201, 523);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 1, 3, 8, 101201, 524);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1, 1, 1, 101202, 526);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もっといっぱい\n超能力使えたら\nいいのにな～", 1, 1, 2, 101202, 527);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねえねえ、\n今から人助け、\n付き合ってほしいなー", 1, 1, 3, 101202, 528);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 1, 1, 4, 101202, 529);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "人助け、頑張ったら\nなんだか、眠く…\n…はっ、ダメダメ！", 1, 1, 5, 101202, 530);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミと一緒なら、\nなんだって出来る！\n間違いない！", 1, 1, 101, 101202, 531);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミを抱き枕に…\nじょ、冗談冗談！", 1, 1, 102, 101202, 532);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "忘れ物しちゃった\nま、いっか！\nえ、ダメ？", 1, 2, 1, 101202, 533);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なに？　困ってる？\nちょうど良かった！\n今は体力満タンだよ☆", 1, 2, 2, 101202, 534);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一緒に\nお出かけしたいなー\nデートしよっ！", 1, 2, 3, 101202, 535);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うんうん、そうだねっ\n困ってる人がいたら\n見過ごせないよねっ！", 1, 2, 4, 101202, 536);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 1, 2, 101, 101202, 537);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "う～だんだん眠く…\nねぇ一緒に寝よ？", 1, 2, 102, 101202, 538);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "キミって早起きだね！\n私は寝ようかな～", 1, 2, 1, 101202, 539);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 1, 2, 2, 101202, 540);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "どんなにお昼寝しても\n夜は眠いんだ～", 1, 2, 3, 101202, 541);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 1, 3, 1, 101202, 542);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 1, 3, 2, 101202, 543);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ…可愛い！\nシオリンに\n届けてあげたい！", 1, 3, 3, 101202, 544);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 1, 3, 4, 101202, 545);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うう～ん、なんだか\nいつもより眠ーく\nなってきたよ…", 1, 3, 5, 101202, 546);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "よーし\n困ってる人のために\nパワーアップ☆", 1, 3, 6, 101202, 547);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "食べてすぐ寝ると\n牛になるんだっけ？\nまぁ、いいかぁ～", 1, 3, 7, 101202, 548);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 1, 3, 8, 101202, 549);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "モデルは楽しいよ！\nファンの子みんな\n応援してくれるしー！", 1, 1, 1, 101601, 551);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 1, 1, 2, 101601, 552);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "んー、今日のおやつは\n何にしよう？\nやっぱアメ玉かな！", 1, 1, 3, 101601, 553);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここで撮影会、\nしようかな～♪", 1, 1, 4, 101601, 554);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 1, 1, 5, 101601, 555);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "やば…\nこのままじゃ、うち\nキュン死にかも…", 1, 1, 101, 101601, 556);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 1, 1, 102, 101601, 557);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちの写真撮るの？\nどんなポーズ？", 1, 2, 1, 101601, 558);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイにしてあげる", 1, 2, 2, 101601, 559);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "宿題見てくんない？\nひとりじゃムリ～", 1, 2, 3, 101601, 560);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "みてこのネイル♪\n超エモくな～い？\nヒデサイもする～？", 1, 2, 4, 101601, 561);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 1, 2, 101, 101601, 562);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 1, 2, 102, 101601, 563);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "早起きとか\nつらたんだよねー\n昼すぎまで寝てたい", 1, 2, 1, 101601, 564);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 1, 2, 2, 101601, 565);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 1, 2, 3, 101601, 566);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どんなシーンにも合う\nきれいめわがまま\nちゃんとコーデだよ♪", 1, 3, 1, 101601, 567);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 1, 3, 2, 101601, 568);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "きゃわたーん☆\n君もおしゃれしよっか", 1, 3, 3, 101601, 569);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいにおいじゃん！\nこれと同じにおいの\n香水ないかな？", 1, 3, 4, 101601, 570);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 1, 3, 5, 101601, 571);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あはは、なんか\nウォーキングの練習\nしてるみたーい！", 1, 3, 6, 101601, 572);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 1, 3, 7, 101601, 573);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 1, 3, 8, 101601, 574);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ\n仕事の時間だ～\n出かける準備\nしよっと！", 1, 1, 1, 101602, 576);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 1, 1, 2, 101602, 577);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ヒデサイを見習って\nうちも少し勉強して\nみよっかな…　", 1, 1, 3, 101602, 578);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体形維持とか\n気にしてるんだよ～", 1, 1, 4, 101602, 579);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 1, 1, 5, 101602, 580);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "やば…\nこのままじゃ、うち\nキュン死にかも…　", 1, 1, 101, 101602, 581);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 1, 1, 102, 101602, 582);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちの写真撮るの？\nどんなポーズ？", 1, 2, 1, 101602, 583);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイに\nしてあげる♪", 1, 2, 2, 101602, 584);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この雑誌の服\nガチめにほしぃ～", 1, 2, 3, 101602, 585);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちのコーデで\nヒデサイをオシャンに\nしてあげるね♪", 1, 2, 4, 101602, 586);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 1, 2, 101, 101602, 587);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 1, 2, 102, 101602, 588);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今日は早起き\nできたんだー\nメイクもばっち\nきまってるっしょ？", 1, 2, 1, 101602, 589);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 1, 2, 2, 101602, 590);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 1, 2, 3, 101602, 591);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この服ね～\n今年のトレンドなんだ♪\nかわたんでしょ！", 1, 3, 1, 101602, 592);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 1, 3, 2, 101602, 593);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うわー\nこのぬいぐるみ\nもきゅすぎでしょ～！", 1, 3, 3, 101602, 594);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいにおーい♪\nファンのみんなにも\n教えてあげよー♪", 1, 3, 4, 101602, 595);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 1, 3, 5, 101602, 596);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "食べた分は\n消費しないとね～", 1, 3, 6, 101602, 597);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 1, 3, 7, 101602, 598);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 1, 3, 8, 101602, 599);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "やっさー\n踊ってると、どんどん\n楽しくなるさー！", 1, 1, 1, 101701, 601);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このお菓子、でーじ\nおいしいねー！\nキミも食べる？", 1, 1, 2, 101701, 602);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ハイターイ！　元気な\nあいさつが一番さ～！", 1, 1, 3, 101701, 603);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 1, 1, 4, 101701, 604);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さぁ、みんなで歌って\n踊るさ～♪", 1, 1, 5, 101701, 605);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "毎日、最高に幸せさ～\nキミのおかげだねー", 1, 1, 101, 101701, 606);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミへの気持ちを\n踊りで表現\nしてみるさ～", 1, 1, 102, 101701, 607);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 1, 2, 1, 101701, 608);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あぎひゃっ！\n急に声かけたら、\nビックリするさ～", 1, 2, 2, 101701, 609);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "踊りなら、\n私が手とり足とり\n教えてあげるさ～！", 1, 2, 3, 101701, 610);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "空手の型の\n練習するさー\nキミもどう？", 1, 2, 4, 101701, 611);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "よ～し、手をつないで\n踊るさ～！\n恥ずかしがること\nないさ～", 1, 2, 101, 101701, 612);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミと一緒だから、\n毎日楽しいこと\nばっかりさー", 1, 2, 102, 101701, 613);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "ハイターイ！\n今日も一日、\nがんばるさー！", 1, 2, 1, 101701, 614);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！", 1, 2, 2, 101701, 615);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "故郷では見えない星が\n見られるんだねえ。\nなんか不思議さぁ", 1, 2, 3, 101701, 616);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "夢中で踊ってたら、\n髪の毛ぼさぼさに\nなってるさ～！？", 1, 3, 1, 101701, 617);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "よく食べてよく踊って\nよく休む。\nそれが元気の秘訣さ～", 1, 3, 2, 101701, 618);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？", 1, 3, 3, 101701, 619);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆", 1, 3, 4, 101701, 620);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "故郷はあんまり暖房を\n使わなかったから、\n新鮮さー！", 1, 3, 5, 101701, 621);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "汗をかくのは\n気持ちいいさー！\nどんどん行くよー！", 1, 3, 6, 101701, 622);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うーん、おいしいさ～\nゴーヤっぽいものを\n混ぜたいさ～", 1, 3, 7, 101701, 623);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！", 1, 3, 8, 101701, 624);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "焦らなくても\nなんくるないさ～\nなるようになるさ～", 1, 1, 1, 101702, 626);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さぁ、みんなで歌って\n踊るさ～♪", 1, 1, 2, 101702, 627);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "元気がないときは\n私のところに来るさー", 1, 1, 3, 101702, 628);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 1, 1, 4, 101702, 629);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ノリノリな音楽と\n踊りで、疲れを\n吹き飛ばすさ～！", 1, 1, 5, 101702, 630);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "毎日、最高に幸せさ～\nキミのおかげだねー", 1, 1, 101, 101702, 631);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "幸せすぎて踊らずには\nいられないさ～", 1, 1, 102, 101702, 632);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 1, 2, 1, 101702, 633);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん？　どうしたの～？\nヒマなら一緒に\n踊ろうさ～", 1, 2, 2, 101702, 634);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "キミと一緒だから\n毎日楽しいこと\nばっかりさー", 1, 2, 3, 101702, 635);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ハイターイ！　元気な\nあいさつが一番さ～！", 1, 2, 4, 101702, 636);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミと踊ってる時が\n一番幸せさ～\nキミもそう思ってたら\nうれしいさ～", 1, 2, 101, 101702, 637);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "海に沈む夕日は\nとっても綺麗さ～！\n今度一緒に見ようね～ ", 1, 2, 102, 101702, 638);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "気持ちのいい朝さー！\nひとっ走り\nしてくるさー！", 1, 2, 1, 101702, 639);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！ ", 1, 2, 2, 101702, 640);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "故郷では見えない星が\n見られるんだねえ\nなんか不思議さぁ ", 1, 2, 3, 101702, 641);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "夢中で踊ってたら\n髪の毛ぼさぼさに\nなってるさ～！？", 1, 3, 1, 101702, 642);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "よく食べてよく踊って\nよく休む\nそれが元気の秘訣さ～", 1, 3, 2, 101702, 643);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？ ", 1, 3, 3, 101702, 644);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆ ", 1, 3, 4, 101702, 645);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "故郷はあんまり暖房を\n使わなかったから\n新鮮さー！", 1, 3, 5, 101702, 646);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "徹夜で踊り続ける\nためにも、まずは\n体を鍛えるさ～", 1, 3, 6, 101702, 647);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…もっと\nおかわりがほしいさー", 1, 3, 7, 101702, 648);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！ ", 1, 3, 8, 101702, 649);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 1, 1, 1, 101801, 651);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このお部屋\n女の子ばかりね。\n魔族の女子校を\n思い出しちゃう♪", 1, 1, 2, 101801, 652);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "次のテスト\n恋愛小説から\n出題したら\nダメかしら…？", 1, 1, 3, 101801, 653);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "キンコンカンコ～ン♪\n授業をはじめま～す", 1, 1, 4, 101801, 654);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はー…\nちょっと肩が\nこっちゃった…", 1, 1, 5, 101801, 655);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 1, 1, 101, 101801, 656);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…", 1, 1, 102, 101801, 657);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 1, 2, 1, 101801, 658);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 1, 2, 2, 101801, 659);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 1, 2, 3, 101801, 660);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "学院の外でも\n私は君の先生よ\nなんでも聞いてね♪", 1, 2, 4, 101801, 661);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "今読んでるのは\nヒロインが年下の子と\n恋に落ちる話…あ、\n深い意味はないのよ～", 1, 2, 101, 101801, 662);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "生徒は全員可愛いけど\n君は少し特別…\nみんなには内緒よ？", 1, 2, 102, 101801, 663);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "学校に\n遅刻しないように\n早く準備しないとね", 1, 2, 1, 101801, 664);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "男の子といっしょに\nお弁当を食べるの、\n夢なんだ～", 1, 2, 2, 101801, 665);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 1, 2, 3, 101801, 666);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もしかして…\n少し露出多いかしら？", 1, 3, 1, 101801, 667);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リラックスすると\nα波が出て、勉強が\nはかどるんですって", 1, 3, 2, 101801, 668);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪　あなたも\n私の生徒になる？", 1, 3, 3, 101801, 669);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "学院にもこういう\n安らぐ設備が\n必要かしらね？", 1, 3, 4, 101801, 670);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "まだ寒いわぁ\n誰か隣に\n来てくれたら…", 1, 3, 5, 101801, 671);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動部の顧問も\nできるかしら？", 1, 3, 6, 101801, 672);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "学校の給食でも\n食べたいわぁ～", 1, 3, 7, 101801, 673);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい参考書を\n見つけちゃった♪", 1, 3, 8, 101801, 674);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私の生徒に\n不良なんていないわ\nみーんないい子♪", 1, 1, 1, 101802, 676);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このお部屋\n女の子ばかりね\n魔族の女子校を\n思い出しちゃう♪", 1, 1, 2, 101802, 677);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの子、まだかな…\n宿題も見てあげたいし\n早く来ないかしら？", 1, 1, 3, 101802, 678);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 1, 1, 4, 101802, 679);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "学校の図書室に\n恋愛小説を\n置いて欲しいなあ", 1, 1, 5, 101802, 680);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 1, 1, 101, 101802, 681);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…　", 1, 1, 102, 101802, 682);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 1, 2, 1, 101802, 683);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 1, 2, 2, 101802, 684);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "宿題はもうやった？\n苦手なところは\n先生が見てあげる♪", 1, 2, 3, 101802, 685);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "んん？　なんだか\n元気がないみたい\n先生がぎゅぅ～って\nしてあげる…　", 1, 2, 4, 101802, 686);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "君のお勉強も\nだいぶ進んできたね～\n補習卒業も近いかな？\n少し寂しいけど…", 1, 2, 101, 101802, 687);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 1, 2, 102, 101802, 688);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝の特別授業\nしてあげましょうか？", 1, 2, 1, 101802, 689);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "午後の授業って\n眠いでしょう？\n気持ちは分かるけど\nがんばってね♪", 1, 2, 2, 101802, 690);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 1, 2, 3, 101802, 691);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もしかして…\n少し露出多いかしら？", 1, 3, 1, 101802, 692);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私の膝枕と、どっちが\nフカフカかしら？", 1, 3, 2, 101802, 693);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "可愛いわね～\n教室に置いたら\n生徒が喜ぶかしら？　", 1, 3, 3, 101802, 694);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "は～落ち着くなぁ～\n教師には\nこういうゆとりも\n必要よね♪　", 1, 3, 4, 101802, 695);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "まだ寒いわぁ\n誰か隣に\n来てくれたら…　", 1, 3, 5, 101802, 696);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動部の顧問も\nできるかしら？　", 1, 3, 6, 101802, 697);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あん！\nお胸にこぼしちゃった", 1, 3, 7, 101802, 698);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あぁーん♪\nこういう物語みたいな\n恋愛あこがれる～　", 1, 3, 8, 101802, 699);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おにいちゃんは、\nにんじん食べられる？", 1, 1, 1, 102001, 701);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "えへへ、\nお絵かきしよ～♪", 1, 1, 2, 102001, 702);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あのね、ミミと\nあそんでほしいな～", 1, 1, 3, 102001, 703);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さっきね、きれいな\nお花見つけたよ。\nおにいちゃんにも\n見せてあげたいな～", 1, 1, 4, 102001, 704);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うさぎさん、\nぴょんぴょん\nぴょーん♪", 1, 1, 5, 102001, 705);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "おにいちゃんの絵、\nかいてあげるね♪", 1, 1, 101, 102001, 706);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 1, 1, 102, 102001, 707);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふわぁ！\nおにいちゃんの手、\nおっきいね～", 1, 2, 1, 102001, 708);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "やった～！\nおにいちゃんが\nほめてくれた～", 1, 2, 2, 102001, 709);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねえねえ\nおにいちゃん、\n一緒にあそぼっ♪", 1, 2, 3, 102001, 710);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おにいちゃん、\n遊んでくれるの？\n　わぁい♪", 1, 2, 4, 102001, 711);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "わぁい！\nおにいちゃんだ～♪\nぎゅ～っ！", 1, 2, 101, 102001, 712);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あのねあのね、\nミミの頭ポンポンって\nしてほしいな", 1, 2, 102, 102001, 713);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おひさまさん、\nおはよ～！\n毎朝、早おきだね～", 1, 2, 1, 102001, 714);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "うわぁ！\nお日さまがすごーく\n高いところにある～", 1, 2, 2, 102001, 715);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "おにいちゃん\nおやすみのご本\nよんで～", 1, 2, 3, 102001, 716);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミミも、\nうさぎさんみたいに、\nかわいくなりたいな♪", 1, 3, 1, 102001, 717);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "のんびり～♪\nゆったり～♪\nまったり～♪", 1, 3, 2, 102001, 718);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "わぁ～かわいい～♪\nミミ、幸せ～♪\n抱きついていいかな？", 1, 3, 3, 102001, 719);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいにおい～♪\nお鼻ピクピク♪\nうさぎさんも喜ぶよ♪", 1, 3, 4, 102001, 720);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったか～♪\nぬくぬく～♪\nポカポカ～♪", 1, 3, 5, 102001, 721);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふ、ふぇ～　ミミ、\n運動苦手だよ～", 1, 3, 6, 102001, 722);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はむ♪　いっぱい\n食べて、はやく\nおっきくなりたいな～", 1, 3, 7, 102001, 723);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミミね！\nこのお話だーい好き！", 1, 3, 8, 102001, 724);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぴょんぴょん\n跳ねるよ\nうっさぎっさ～ん♪", 1, 1, 1, 102002, 726);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うさぎさんの\nマネだよ～\n似てるかな～？", 1, 1, 2, 102002, 727);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "モフモフすると\nきもちい～よ", 1, 1, 3, 102002, 728);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミソギちゃん\nキョウカちゃん\nあ～そ～ぼっ！", 1, 1, 4, 102002, 729);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おにいちゃん\nおやすみのご本\nよんで～", 1, 1, 5, 102002, 730);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ねえ、おにいちゃん\nミミのこと、すき？", 1, 1, 101, 102002, 731);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 1, 1, 102, 102002, 732);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "やった～！\nおにいちゃんが\nほめてくれた～", 1, 2, 1, 102002, 733);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おにいちゃん\n遊んでくれるの？\nわぁい♪", 1, 2, 2, 102002, 734);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おにいちゃん\nあのね…\nいいこいいこして～", 1, 2, 3, 102002, 735);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あはは～\nくすぐったいよ～", 1, 2, 4, 102002, 736);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "おにいちゃんの\nおひざの上、とっても\n安心するんだ～！", 1, 2, 101, 102002, 737);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "わぁい♪\nおにいちゃんの\nなでなで\nうれし～な♪", 1, 2, 102, 102002, 738);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おひさまさん\nおはよ～！\n毎朝、早おきだね～", 1, 2, 1, 102002, 739);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼寝お昼寝～♪\nおにいちゃんと一緒に\nお昼寝～♪", 1, 2, 2, 102002, 740);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "眠くなっちゃった～\nおにいちゃん！\n今日は一緒に寝よ～", 1, 2, 3, 102002, 741);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミミも\nうさぎさんみたいに\nかわいくなりたいな", 1, 3, 1, 102002, 742);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふわふわ～モコモコ～\n気持ちいい～♪\nミミもゴロゴロ～ン♪", 1, 3, 2, 102002, 743);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "わぁ～かわいい～♪\nミミ、幸せ～♪\n抱きついていいかな？", 1, 3, 3, 102002, 744);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいにおい～♪\nお鼻ピクピク♪\nうさぎさんも喜ぶよ～♪", 1, 3, 4, 102002, 745);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったか～♪\nぬくぬく～♪\nポカポカ～♪", 1, 3, 5, 102002, 746);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁはぁ…\nふえ～ミミ\n疲れちゃうよ～！", 1, 3, 6, 102002, 747);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はむ♪　いっぱい\n食べて、はやく\nおっきくなりたいな～", 1, 3, 7, 102002, 748);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミミね！\nこのお話だーい好き！", 1, 3, 8, 102002, 749);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぅぅ…\n部屋のどこにいたら\nいいんだろう…", 1, 1, 1, 102101, 751);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お外より\nお部屋の中の方が\n落ち着くな…", 1, 1, 2, 102101, 752);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クッキー焼いたら\nみんな食べてくれる\nかなぁ…", 1, 1, 3, 102101, 753);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、あめんぼあかいな\nあいうえお！", 1, 1, 4, 102101, 754);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お芝居には\n人間観察が大事…\nじーーーーーー…", 1, 1, 5, 102101, 755);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "お兄ちゃんを見ると、\n顔が赤くなっちゃうの\n…な、なんでかな？", 1, 1, 101, 102101, 756);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…", 1, 1, 102, 102101, 757);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こ、この本、とっても\nおもしろいんですよ♪", 1, 2, 1, 102101, 758);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "い、一緒に遊んで\nくれるんですか？\nや、やったぁ～♪", 1, 2, 2, 102101, 759);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ランドソルには\n慣れましたか？\nわ、私はまだ…", 1, 2, 3, 102101, 760);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お、お兄ちゃん、\nお、お話の練習に\n付き合って欲しいです", 1, 2, 4, 102101, 761);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ", 1, 2, 101, 102101, 762);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪", 1, 2, 102, 102101, 763);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今日は一日、\n恥ずかしがらずに\n過ごせるかなあ…？", 1, 2, 1, 102101, 764);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼ご飯、どうぞ♪\nわ、私、お料理、\nうまくなったかな？", 1, 2, 2, 102101, 765);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "おにいちゃんが\n帰ってくるまで、\nがんばって\n起きてました", 1, 2, 3, 102101, 766);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "可愛い女の子に変身！\n出来ますように…♪", 1, 3, 1, 102101, 767);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふかふかで\nあったかくて…\nお兄ちゃんみたい♪", 1, 3, 2, 102101, 768);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この子を相手に、\n演技の練習～", 1, 3, 3, 102101, 769);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リボンや服に\n染み込ませておこう。\nいつでもいい匂い♪", 1, 3, 4, 102101, 770);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "えへへ。\nぽっかぽかです…", 1, 3, 5, 102101, 771);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁはぁ…\nふひぃ…\nはうぅぅぅ～～", 1, 3, 6, 102101, 772);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…えへへ、\n美味しいものを\n食べてると幸せです", 1, 3, 7, 102101, 773);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "戯曲を読んで\n自分が演じるところを\n想像するの…", 1, 3, 8, 102101, 774);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいいものを\nこうして並べて…\nはぁ…落ちつくぅ♪", 1, 1, 1, 102102, 776);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふぁ～、この部屋は\n時間がゆったりと\n流れてるみたい", 1, 1, 2, 102102, 777);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この台本、感動…\n涙が止まらないよぉ\nいつか演じてみたいな", 1, 1, 3, 102102, 778);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お芝居には\n人間観察が大事…\nじーーーーーー…", 1, 1, 4, 102102, 779);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あえいうえおあお\nかけきくけ、かっ…\nむ、難しいですぅぅ", 1, 1, 5, 102102, 780);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お、お腹が空いた時は\n言ってくださいね\nが、頑張って\n作ります！", 1, 1, 101, 102102, 781);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…", 1, 1, 102, 102102, 782);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こ、この本、とっても\nおもしろいんですよ♪", 1, 2, 1, 102102, 783);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お兄ちゃんと\nいっぱい話せた日は、\n嬉しくなっちゃいます", 1, 2, 2, 102102, 784);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何か私にできる事\n…そうだ！\nお掃除しますね！", 1, 2, 3, 102102, 785);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私、ちょっとずつ、\n自分に自信が\nついてきたかもです…", 1, 2, 4, 102102, 786);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ", 1, 2, 101, 102102, 787);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪", 1, 2, 102, 102102, 788);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます♪\n声出しして、お芝居の\n練習しなくちゃ", 1, 2, 1, 102102, 789);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お茶にしますか？\nクッキー焼いたので、\nよかったら…", 1, 2, 2, 102102, 790);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "寝る前に\n台本を読むと、\n覚えやすいんです", 1, 2, 3, 102102, 791);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "可愛い女の子に変身！\n出来ますように…♪", 1, 3, 1, 102102, 792);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぅ…\nフッカフカァ…\n癒されちゃいます…", 1, 3, 2, 102102, 793);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この子を相手に\n演技の練習～", 1, 3, 3, 102102, 794);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リボンや服に\n染み込ませておこう\nいつでもいい匂い♪", 1, 3, 4, 102102, 795);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "えへへ\nぽっかぽかです…", 1, 3, 5, 102102, 796);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "え、演劇には\nた、体力も重要\nだから～", 1, 3, 6, 102102, 797);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "残さず\n食べますね…！", 1, 3, 7, 102102, 798);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "戯曲を読んで\n自分が演じるところを\n想像するの…", 1, 3, 8, 102102, 799);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 1, 1, 1, 102201, 801);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アカリみたいに\nかわいくなるには、\nどうすればいいのかな", 1, 1, 2, 102201, 802);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "レアカードをゲット！\nねえねえ、\nすごいでしょ！？", 1, 1, 3, 102201, 803);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ア、アイツと同じ\n部屋にいるのよね…\nって、だから何よ！？", 1, 1, 4, 102201, 804);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "楽しいゲームって\nやめどきが\n見つからないわ", 1, 1, 5, 102201, 805);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 1, 1, 101, 102201, 806);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "うぅ…最近、\nアイツを見るとなんか\nドキドキするのよね", 1, 1, 102, 102201, 807);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ゲームに負けた罰\nだからって、\nくすぐるのは…\nあはは…ダメだって！", 1, 2, 1, 102201, 808);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アンタと話すのは割と\n緊張しないのよね\n…なんでかな", 1, 2, 2, 102201, 809);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "待ちきれない…\n新作ゲームの発売日が\n待ちきれない…", 1, 2, 3, 102201, 810);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アンタは人見知り\nしないタチよね？\nいいなあ～…", 1, 2, 4, 102201, 811);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 1, 2, 101, 102201, 812);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "アンタと…そ、その\nこうして話してるのも\nわわ、悪くないわね！", 1, 2, 102, 102201, 813);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 1, 2, 1, 102201, 814);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 1, 2, 2, 102201, 815);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜はこれからよ！\n朝まで\nゲームするからね！", 1, 2, 3, 102201, 816);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アカリみたいに\n可愛くなるのは\n難しいかな", 1, 3, 1, 102201, 817);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "寝っ転がりながら\nゲームができれば\n気分が良さそう", 1, 3, 2, 102201, 818);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "可愛い…けど、\n私には似合わないかな", 1, 3, 3, 102201, 819);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はあ、リラックスして\nゲームができるわ", 1, 3, 4, 102201, 820);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん…暖かくて、\n寝落ちしちゃいそう", 1, 3, 5, 102201, 821);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ゲーム感覚でやると、\n体動かすのも\n楽しいわね", 1, 3, 6, 102201, 822);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 1, 3, 7, 102201, 823);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 1, 3, 8, 102201, 824);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さあ、今日は\n何のゲームで\n遊ぼうかな？", 1, 1, 1, 102202, 826);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一緒にゲームができる\n人がいるっていうのも\n新鮮だな…", 1, 1, 2, 102202, 827);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "レアカードをゲット！\nすごいでしょ！？", 1, 1, 3, 102202, 828);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アカリってどうやって\n友達作ってるんだろ？\nコツがあるのかな…", 1, 1, 4, 102202, 829);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "楽しいゲームって\nやめどきが\n見つからないわ", 1, 1, 5, 102202, 830);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "うぅ…最近\nアイツを見るとなんか\nドキドキするのよね", 1, 1, 101, 102202, 831);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ね、ねえ\nもう少しその…\n一緒にゲームしない？", 1, 1, 102, 102202, 832);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 1, 2, 1, 102202, 833);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "欲しいゲームが\n見つからなくて…\n探すの手伝って！", 1, 2, 2, 102202, 834);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねえ、見て！\n新しいゲームを\n買って来たの！", 1, 2, 3, 102202, 835);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ゲームに負けた罰\nだからって、くすぐる\nのは…あ、あはは！\nだ、ダメだって！", 1, 2, 4, 102202, 836);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 1, 2, 101, 102202, 837);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あ、あのさ…\nもう少し、そこに\nいてくれてもいいわよ", 1, 2, 102, 102202, 838);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 1, 2, 1, 102202, 839);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 1, 2, 2, 102202, 840);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜はこれからよ！\n朝まで\nゲームするからね！", 1, 2, 3, 102202, 841);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 1, 3, 1, 102202, 842);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふああ…\n徹夜明けには\n辛い誘惑だな…", 1, 3, 2, 102202, 843);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "可愛い…けど、\n私には似合わないかな", 1, 3, 3, 102202, 844);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういうのに詳しいと\n女の子っぽく\n見えたりするのかな", 1, 3, 4, 102202, 845);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "寒い日は\nここでゲームするのが\n最高のぜいたくよね", 1, 3, 5, 102202, 846);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近ゲームばかりだし\nたまにはいいかな？", 1, 3, 6, 102202, 847);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 1, 3, 7, 102202, 848);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 1, 3, 8, 102202, 849);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "じゃんけんぽん！\nあっち向いてほい！\nあ～ん、負けたぁ\n　『勝ったぜ！』", 1, 1, 1, 102301, 851);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぷうきちがいれば、\nなんでも出来ちゃうよ", 1, 1, 2, 102301, 852);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "発声練習しよっと\nぷうきち\nフルスイ～ング！", 1, 1, 3, 102301, 853);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここで、ぷうきち\nフルスイングは、\nまずいかな～？", 1, 1, 4, 102301, 854);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋、ぷうきちを\n置く場所はないのかな", 1, 1, 5, 102301, 855);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "お兄ちゃんって…\nちょっとぷうきちに\n似てるかも♪", 1, 1, 101, 102301, 856);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お兄ちゃんにも、\nぷうきちのこと\n好きになって\nもらいたいな～", 1, 1, 102, 102301, 857);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おやつは、\n私とぷうきちの\n二人分用意してね♪", 1, 2, 1, 102301, 858);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぷうきちが、お腹\nペコペコだって～\n何かちょうだい！", 1, 2, 2, 102301, 859);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "『アヤネに手出したら\n…坊ちゃんでも、\n分かってんな？』", 1, 2, 3, 102301, 860);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぷうきちとの\n連携を磨いてるの！\nもっと仲良くなるよ！", 1, 2, 4, 102301, 861);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "特別だからね？\nもっと触っていいよ\n…ぷうきちのこと", 1, 2, 101, 102301, 862);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お兄ちゃんのこと、\n「ぷう兄」って\n呼ぼうかな？", 1, 2, 102, 102301, 863);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "お兄ちゃんって\n朝早いんだね～\n私はまだ眠いよ～", 1, 2, 1, 102301, 864);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ふぁ～…ぷうきちと\nお昼寝してくるね…", 1, 2, 2, 102301, 865);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ぷうきちと\nおしゃべりしてたら\nもうこんな時間…", 1, 2, 3, 102301, 866);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "『座り心地がいいな』\nぷうきちは座れない\nでしょ？", 1, 3, 2, 102301, 868);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい～！\nぷうきちのお友達に\nしちゃおうかな？", 1, 3, 3, 102301, 869);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいニオイ～♪\nぷうきちも\n気に入ったみたい！", 1, 3, 4, 102301, 870);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぽわぽわする～\nぷうきちも\n気持ちいい？", 1, 3, 5, 102301, 871);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしい～\nぷうきちも\n食べてみる？", 1, 3, 7, 102301, 873);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぷうきち！\nこの本、読んで～！", 1, 3, 8, 102301, 874);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 1, 1, 1, 102501, 901);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 1, 1, 2, 102501, 902);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうしたら転ばなく\nなるんでしょうか？", 1, 1, 3, 102501, 903);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "わわわわ～～っ\nふう…\nきゃ、きゃあっ！", 1, 1, 4, 102501, 904);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私のドジで、\nこのお部屋を\n壊しちゃったら\nどうしましょう～～", 1, 1, 5, 102501, 905);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "おいしい料理で\nお出迎えしなくちゃ！", 1, 1, 101, 102501, 906);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "一生懸命\nご奉仕しますよ～♪", 1, 1, 102, 102501, 907);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "耳かきしましょうか？\nえ？　こわい？", 1, 2, 1, 102501, 908);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お疲れでしたら、\nお昼寝しませんか？\n膝枕もしますよ？", 1, 2, 2, 102501, 909);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おかえりなさいませ\nご主人さま♪", 1, 2, 3, 102501, 910);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "すみません\nすみません\nすみません～～", 1, 2, 4, 102501, 911);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "メイドの私が、\nこんな気持ちを持って\nいいんでしょうか…", 1, 2, 101, 102501, 912);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私のこと、\n専属メイドと思って\n頼ってくださいね", 1, 2, 102, 102501, 913);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます♪\n今日も一日がんば…\nきゃ、きゃあ！", 1, 2, 1, 102501, 914);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 1, 2, 2, 102501, 915);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 1, 2, 3, 102501, 916);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 1, 3, 1, 102501, 917);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "休憩が終わったら\nお洗濯にお料理に\nお掃除もしないと！", 1, 3, 2, 102501, 918);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\nあとでお洗濯\nしてあげますね", 1, 3, 3, 102501, 919);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 1, 3, 4, 102501, 920);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここでお洗濯ものを\n乾かしましょうか", 1, 3, 5, 102501, 921);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あわわわっ…\nこ、転びそうです～！", 1, 3, 6, 102501, 922);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これくらい\nおいしいものを\n作ってみたいです～", 1, 3, 7, 102501, 923);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 1, 3, 8, 102501, 924);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "失敗したら、この\nお部屋追い出され\nちゃうかも～？", 1, 1, 1, 102502, 926);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 1, 1, 2, 102502, 927);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうやったら、立派な\nメイドになれるのかな", 1, 1, 3, 102502, 928);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "塩にはＳマーク\n砂糖にはＳマーク\n…あ、あれ！？", 1, 1, 4, 102502, 929);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ご用があれば\nなんでも言って\nくださいね", 1, 1, 5, 102502, 930);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "迷惑をかけすぎて…\n嫌われちゃったら\nどうしましょう", 1, 1, 101, 102502, 931);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "メイドの私が\nこんな気持ちを持って\nいいんでしょうか…　", 1, 1, 102, 102502, 932);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おでかけですか？\nいってらっしゃいませ\nご主人さま♪", 1, 2, 1, 102502, 933);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 1, 2, 2, 102502, 934);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私、またなにか\nやっちゃいましたか？", 1, 2, 3, 102502, 935);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしいお茶っ葉が\n手に入りました～♪\n一緒に飲みませんか？", 1, 2, 4, 102502, 936);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "転んだふりであの人に\n…って！\nなんでもないですよ！", 1, 2, 101, 102502, 937);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私、できることなら\nなんでもやりますよ\nあなたのためですから", 1, 2, 102, 102502, 938);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます♪\n今日も一日がんば…\nう、うわあ！", 1, 2, 1, 102502, 939);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 1, 2, 2, 102502, 940);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 1, 2, 3, 102502, 941);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 1, 3, 1, 102502, 942);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい座り心地です～\nこれならお嬢さまも\nゆったりできますね♪", 1, 3, 2, 102502, 943);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\nあとでお洗濯\nしてあげますね", 1, 3, 3, 102502, 944);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 1, 3, 4, 102502, 945);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "暖かいですけど\n…私が火に近づいて\n大丈夫でしょうか！？", 1, 3, 5, 102502, 946);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動しようとすると\nいつも怪我するん\nですよね…", 1, 3, 6, 102502, 947);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こんなに美味しいもの\nメイドの私には\nもったいないです～！", 1, 3, 7, 102502, 948);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 1, 3, 8, 102502, 949);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの方と私だけの\n部屋にしたいですわ", 1, 1, 1, 102701, 951);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの方は私のもの…\n眼も耳も鼻も口も髪も\n首も胸も腰も手も脚も\nぬくもりも心も…！", 1, 1, 2, 102701, 952);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運命とは決して\n抗えないもの…\nクスクス…クスクス", 1, 1, 3, 102701, 953);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋からあの方の\n香りが…\nああ、至福ですわ", 1, 1, 4, 102701, 954);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "毒にも薬にもならない\n存在なんて嫌ですわ\nどうせならとびきりの\n毒でありたい…", 1, 1, 5, 102701, 955);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 1, 1, 101, 102701, 956);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 1, 1, 102, 102701, 957);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運命を信じますか？\nもちろん絶対当然\n信じますわよね？", 1, 2, 1, 102701, 958);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この薬は起床時就寝前\n食前食後食間に、毎日\n服用してください。\n惚れ薬ですわ", 1, 2, 2, 102701, 959);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お願いがあるのです。\n新しい研究の実験台に\n…", 1, 2, 3, 102701, 960);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 1, 2, 4, 102701, 961);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 1, 2, 101, 102701, 962);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私の身も心も、全てが\nあなた様のもの。\nあなた様の全ても…", 1, 2, 102, 102701, 963);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 1, 2, 1, 102701, 964);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼を用意しましたの\n何も入れていませんわ\nクスクス…", 1, 2, 2, 102701, 965);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "あなた様が眠るまで\nお傍で見守りますわ。\n…あの、どうして\n眠らないのですか？", 1, 2, 3, 102701, 966);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いっそ鏡の中に\n閉じ込めてしまえたら\n私だけのものに…", 1, 3, 1, 102701, 967);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はっ！\nリラックスしたら\n閃きましたわ！", 1, 3, 2, 102701, 968);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あら、キメラの素体に\nぴったりですわ", 1, 3, 3, 102701, 969);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このお部屋は\n良い香りがしますわ。\nはっ、あなた様の匂い\nなのでは…！？", 1, 3, 4, 102701, 970);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたたかい…\n加熱調合にも\n使えそうですわね", 1, 3, 5, 102701, 971);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 1, 3, 6, 102701, 972);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 1, 3, 7, 102701, 973);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 1, 3, 8, 102701, 974);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの方と私だけの\n部屋にしたいですわ", 1, 1, 1, 102702, 976);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 1, 1, 2, 102702, 977);
