INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋からあの方の\n香りが…\nああ、至福ですわ", 1, 1, 4, 102702, 979);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 1, 1, 5, 102702, 980);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 1, 1, 101, 102702, 981);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "魔法も科学も錬金術も\n全て駆使して\nあの方のために…", 1, 1, 102, 102702, 982);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋には雌犬…\n失礼、女の方がとても\n沢山いますのね", 1, 2, 1, 102702, 983);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あなた様には私の伴侶\nとして高い教養を…\nあ、逃げられてしまい\nましたわ…！", 1, 2, 2, 102702, 984);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お願いがあるのです\n新しい研究の\n実験台に…", 1, 2, 3, 102702, 985);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あなた様が寝ている時\n私は…クスクス\nこれ以上は言えません", 1, 2, 4, 102702, 986);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "想像の中のあなた様は\nすっかり私の虜なのに\n現実は…\nもどかしいですわね", 1, 2, 101, 102702, 987);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 1, 2, 102, 102702, 988);
