INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "さあ、お食事ですよ\n味は保証しますわ\n特製ソースで少しだけ\n体が痺れますけど…", 1, 2, 2, 102702, 990);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "あなた様が眠るまで\nお傍で見守りますわ\n…あの、どうして\n眠らないのですか？", 1, 2, 3, 102702, 991);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私ももう少し\n外見に気を配る\nべきでしょうか…", 1, 3, 1, 102702, 992);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はっ！\nリラックスしたら\n閃きましたわ！", 1, 3, 2, 102702, 993);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この私を差し置いて\nあなた様に媚びるなど\n言語道断…っ！", 1, 3, 3, 102702, 994);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このお部屋は\n良い香りがしますわ\nはっ、あなた様の匂い\nなのでは…！？", 1, 3, 4, 102702, 995);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "素敵なぬくもり…\nまるであの方に\n抱きしめられたような", 1, 3, 5, 102702, 996);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 1, 3, 6, 102702, 997);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 1, 3, 7, 102702, 998);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 1, 3, 8, 102702, 999);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1, 1, 1, 102801, 1001);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "使えるものは\n再利用しないと\n…あ、これとか\nまだ使えるわね", 1, 1, 2, 102801, 1002);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "贅沢は敵！　とはいえ\n気持ちに余裕のない\n暮らしはダメよね", 1, 1, 3, 102801, 1003);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お腹空いたわね、\n残り物で\n何か作ろうかしら", 1, 1, 4, 102801, 1004);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1, 1, 5, 102801, 1005);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 1, 1, 101, 102801, 1006);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "焼きそばパンが\n食べたいな～\nあいつと…", 1, 1, 102, 102801, 1007);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねぇあんた、どこか\n安いお店知らない？", 1, 2, 1, 102801, 1008);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたし、エレガントに\n振る舞えてる？\n…そう？　嬉しい♪", 1, 2, 2, 102801, 1009);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いっぱい働いて遊んで\nよく休んでまた働く。\nそれが健全な生活よね", 1, 2, 3, 102801, 1010);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一緒に部屋の\n整頓でもする？\nハマると楽しいわよ♪", 1, 2, 4, 102801, 1011);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あんたがいると\n子供たちも喜ぶわ♪\nもちろんあたしもね！", 1, 2, 101, 102801, 1012);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ね、あんた今、幸せ？\n何びっくりしてるのよ\n大事なことじゃないの", 1, 2, 102, 102801, 1013);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "面倒な用事は午前中に\n片づけてしまうのが、\n時間の使い方のコツよ", 1, 2, 1, 102801, 1014);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "午後のティータイム\nとかどう？\n良いカフェがあるの♪", 1, 2, 2, 102801, 1015);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "さ、エレガントな夜を\n楽しみましょ。\nモダンな音楽でも\nかけましょうか？", 1, 2, 3, 102801, 1016);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "レディたるもの\n身嗜みはしっかりとね\n見本にならないと♪", 1, 3, 1, 102801, 1017);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これで仕事は一段落ね\nちょっと休憩…", 1, 3, 2, 102801, 1018);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うふふ、\nかわいいものを\n見るのは幸せね～", 1, 3, 3, 102801, 1019);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1, 3, 4, 102801, 1020);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "風邪を引かないように\n身体を温めなくちゃ", 1, 3, 5, 102801, 1021);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1, 3, 6, 102801, 1022);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…はっ、\n口の周り、\n汚れてないわよね？", 1, 3, 7, 102801, 1023);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "知識から過去を学んで\n未来に活かすわよ", 1, 3, 8, 102801, 1024);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "安売りのお店の情報\n整理しないと…", 1, 1, 1, 102802, 1026);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どんなに苦労してても\nそう見せないのが真の\nエレガントなレディよ", 1, 1, 2, 102802, 1027);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "安く済んであいつが\n喜ぶ料理とか…\nないかしら", 1, 1, 3, 102802, 1028);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1, 1, 4, 102802, 1029);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1, 1, 5, 102802, 1030);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "焼きそばパンが\n食べたいな～\nあいつと…", 1, 1, 101, 102802, 1031);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あいつと一緒に…\n色々なところに\nいきたいな", 1, 1, 102, 102802, 1032);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今度買い物に\n付き合いなさい\nセールがあるのよ", 1, 2, 1, 102802, 1033);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんたがいると子供\nたちも喜ぶわ♪\nもちろんあたしもね♪", 1, 2, 2, 102802, 1034);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いっぱい働いて遊んで\nよく休んでまた働く\nそれが健全な生活よね", 1, 2, 3, 102802, 1035);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんたとこうして\nのんびりするのも\nいいものね", 1, 2, 4, 102802, 1036);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ねえ、今度遊びに\n行きたいな\nもちろん一緒に、よ", 1, 2, 101, 102802, 1037);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 1, 2, 102, 102802, 1038);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "面倒な用事は午前中に\n片づけてしまうのが\n時間の使い方のコツよ", 1, 2, 1, 102802, 1039);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ランチにして午後の\n仕事に備えましょ！\nやることは一杯よ♪", 1, 2, 2, 102802, 1040);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ふわあ～\nもうこんな時間\n子供たちは\nもう寝たかしら", 1, 2, 3, 102802, 1041);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "忙しい時こそ\n身だしなみは隙なく\nぴしっとね！", 1, 3, 1, 102802, 1042);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これで仕事は一段落ね\nちょっと休憩…", 1, 3, 2, 102802, 1043);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふふふ\nずっと眺めてたく\nなっちゃうわね", 1, 3, 3, 102802, 1044);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1, 3, 4, 102802, 1045);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "風邪を引かないように\n身体を温めなくちゃ", 1, 3, 5, 102802, 1046);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1, 3, 6, 102802, 1047);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "しっかり食べて\n栄養補給、栄養補給！", 1, 3, 7, 102802, 1048);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "知識から過去を学んで\n未来に活かすわよ", 1, 3, 8, 102802, 1049);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "可愛い子が\nいっぱいいるなぁ…\n誰か私とユニット\n組んでくれないかな？", 1, 1, 1, 102901, 1051);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今度のライブ会場、\nいつもより大きいから\n楽しみなんだ～！", 1, 1, 2, 102901, 1052);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1, 1, 3, 102901, 1053);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "彼とデュエット\nしてみたいな～♪", 1, 1, 4, 102901, 1054);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "キラキラ無病息災、\nドキドキ一日一善…\n作詞って難しい～", 1, 1, 5, 102901, 1055);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1, 1, 101, 102901, 1056);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "写真集見なくても、\n本物がここに\nいるのにな～", 1, 1, 102, 102901, 1057);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "握手会の練習、\n付き合ってくれない？", 1, 2, 1, 102901, 1058);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "写真集のポーズ\n練習中～！\nど、どうかな？", 1, 2, 2, 102901, 1059);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何て書いてあるか\n読めないって？\nもー！\nこれは私のサイン！", 1, 2, 3, 102901, 1060);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ね、次のライブ\n観に来てくれる？\nいい席とっとくから！", 1, 2, 4, 102901, 1061);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ねぇ、台本読むの\nつきあってくれる？\n恋人役に\nなってほしいんだ", 1, 2, 101, 102901, 1062);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ。\nどこかは秘密だけど♪", 1, 2, 102, 102901, 1063);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1, 2, 1, 102901, 1064);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "この時間は\nお腹すくけど…\n水着撮影があるから\nお昼抜いてるんだ", 1, 2, 2, 102901, 1065);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ。", 1, 2, 3, 102901, 1066);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1, 3, 1, 102901, 1067);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1, 3, 2, 102901, 1068);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1, 3, 3, 102901, 1069);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ステキな香り～♪\n歌詞のイメージが\n浮かんできそう！", 1, 3, 4, 102901, 1070);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1, 3, 5, 102901, 1071);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1, 3, 6, 102901, 1072);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1, 3, 7, 102901, 1073);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ステキなお話…\n新曲の作詞の\n参考になりそう♪", 1, 3, 8, 102901, 1074);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このお部屋すてき！\nファンに追われた時の\n隠れ家にピッタリね！", 1, 1, 1, 102902, 1076);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろイメチェン\nしてみようかな…\nそれともこの路線で\nもう少し…？", 1, 1, 2, 102902, 1077);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "みんながくれた\nファンレター…\n私の大事な宝物…", 1, 1, 3, 102902, 1078);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "彼とデュエット\nしてみたいな～♪", 1, 1, 4, 102902, 1079);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "疾風怒濤、威風堂々\n獅子奮迅、唯我独尊…\nラブソングの作詞って\n難しいな～", 1, 1, 5, 102902, 1080);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 1, 1, 101, 102902, 1081);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "トップアイドルの\nさらに先…\n彼とならその景色も\n見られるかな", 1, 1, 102, 102902, 1082);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1, 2, 1, 102902, 1083);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アイドルノゾミだけ\nじゃなくて、私の事も\nちゃんと見てね？", 1, 2, 2, 102902, 1084);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "キミに響かないなら\nファンにも響くわけ\nないよ！　練習練習！", 1, 2, 3, 102902, 1085);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "衣装のスカートは\n鉄壁なんだよ！\n残念でした～", 1, 2, 4, 102902, 1086);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ\nどこかは秘密だけど♪", 1, 2, 101, 102902, 1087);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ねぇ、私がトップ\nアイドルになっても\nちゃんと隣にいてね\n遠くに行かないでね？", 1, 2, 102, 102902, 1088);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1, 2, 1, 102902, 1089);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼ごはん行かない？\n誰にも知られてない\nお店があるんだけど！", 1, 2, 2, 102902, 1090);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ", 1, 2, 3, 102902, 1091);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1, 3, 1, 102902, 1092);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1, 3, 2, 102902, 1093);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1, 3, 3, 102902, 1094);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "みんなのイメージする\nアイドルの香りは\nこんな感じかな～", 1, 3, 4, 102902, 1095);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1, 3, 5, 102902, 1096);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1, 3, 6, 102902, 1097);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1, 3, 7, 102902, 1098);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この恋愛小説ステキ！\n私もアイドルじゃ\nなかったら…", 1, 3, 8, 102902, 1099);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "手裏剣の数が\n合わないデス！\nどこかに落とした\nデスか…？", 1, 1, 1, 103001, 1101);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1, 1, 2, 103001, 1102);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "金は天下の\nマワリモノ！\nところで、\nどういう意味デス？", 1, 1, 3, 103001, 1103);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "むむ、アクダイカンの\n気配がするデース", 1, 1, 4, 103001, 1104);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クニトリ合戦、\n楽しみデース！", 1, 1, 5, 103001, 1105);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ショーグンと\n出会えて、\nワタシは果報者デス！", 1, 1, 101, 103001, 1106);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1, 1, 102, 103001, 1107);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なんでも\n命令するデス！\nショーグンの命は\n絶対デス！", 1, 2, 1, 103001, 1108);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あっ、ショーグン、\n出陣はいつで\nゴザルデス！？", 1, 2, 2, 103001, 1109);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さ、さすが\nショーグンデス…\nいつの間に背後を！？", 1, 2, 3, 103001, 1110);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "出陣の合図に\n備えるデス！\nほら貝は\nどこデスか！？", 1, 2, 4, 103001, 1111);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 1, 2, 101, 103001, 1112);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 1, 2, 102, 103001, 1113);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようデス！\n今日も一日\n忍法日和デス！", 1, 2, 1, 103001, 1114);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "そろそろお腹\n空いてきたデス。\n昼ごはんにするデス！", 1, 2, 2, 103001, 1115);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "明日もきっと\nいい日デスよ、\nショーグン！", 1, 2, 3, 103001, 1116);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちょんまげに\nしてみるのも\n面白いかもデス！", 1, 3, 1, 103001, 1117);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "心地よくて\n眠くなってきマス…\nもしやテキコクの\n罠デスか！？", 1, 3, 2, 103001, 1118);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1, 3, 3, 103001, 1119);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1, 3, 4, 103001, 1120);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身体を暖めて\nイクサに向かうデス！", 1, 3, 5, 103001, 1121);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アクロバットな忍法を\n使うには、体を\n鍛えないと危険デス！", 1, 3, 6, 103001, 1122);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うーん、\n美味しいデス…\n幸せデス～", 1, 3, 7, 103001, 1123);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これは…\nＢＵＳＨＩＤＯ…\nデスか？", 1, 3, 8, 103001, 1124);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふんふんふ～ん\n武器の手入れは\n念入りにしマスよ～", 1, 1, 1, 103002, 1126);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1, 1, 2, 103002, 1127);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "金は天下の\nマワリモノ！\nところで\nどういう意味デス？", 1, 1, 3, 103002, 1128);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "むむ、アクダイカンの\n気配がするデース", 1, 1, 4, 103002, 1129);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クニトリ合戦\n楽しみデース！", 1, 1, 5, 103002, 1130);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 1, 1, 101, 103002, 1131);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ショーグンの身は\n何があってもワタシが\n守るデス！", 1, 1, 102, 103002, 1132);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あっ、ショーグン\n出陣はいつで\nゴザルデス！？", 1, 2, 1, 103002, 1133);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "イクサの前に\nホネ休めも大事デスよ\nゆっくりするデース！", 1, 2, 2, 103002, 1134);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さ、さすがショーグン\nデス…いつの間に\n背後を！？", 1, 2, 3, 103002, 1135);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一緒に忍法考える\nデス！\nショーグン用の\n忍法も必要デスね！", 1, 2, 4, 103002, 1136);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 1, 2, 101, 103002, 1137);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 1, 2, 102, 103002, 1138);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "いい朝デス！\nトーゴク風の朝ゴハン\n作るデス！", 1, 2, 1, 103002, 1139);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "もうお昼デス\nお昼寝するデスか？", 1, 2, 2, 103002, 1140);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "そろそろおネム\nデース…\n一緒に寝るデス？", 1, 2, 3, 103002, 1141);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "服の乱れは心の乱れ\nデス！　きっちり\nしないといけないデス", 1, 3, 1, 103002, 1142);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "心地よくて眠く\nなってきマス…\nもしやテキコクの\n罠デスか！？", 1, 3, 2, 103002, 1143);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1, 3, 3, 103002, 1144);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1, 3, 4, 103002, 1145);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身体を暖めてイクサに\n向かうデス！", 1, 3, 5, 103002, 1146);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ショーグンのお役に\n立つため、修行\nあるのみデス！", 1, 3, 6, 103002, 1147);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美味しいデス…\n酢昆布を和えて\nみたいデス", 1, 3, 7, 103002, 1148);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "物事を知って\n来たるべきイクサに\n活かすデス", 1, 3, 8, 103002, 1149);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1, 1, 1, 103101, 1151);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "父は、いつも男性に\nきびしいですね", 1, 1, 2, 103101, 1152);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "占ってほしい人は、\nいつでも言って\nください", 1, 1, 3, 103101, 1153);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1, 1, 4, 103101, 1154);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋、風水的にも\n運気が上がりそうです", 1, 1, 5, 103101, 1155);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あの人とのこと占って\nみようかな…\n好き…嫌い…\n好き♪…き、嫌い", 1, 1, 101, 103101, 1156);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 1, 1, 102, 103101, 1157);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "女難の相が\n出ていますね…\n気をつけてください", 1, 2, 1, 103101, 1158);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日のあなたの運勢は\n大きょ…\n大吉です", 1, 2, 2, 103101, 1159);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "父と散歩中です。\n毎日決まったコースを\n散歩させないと、\nストレスが溜まるので", 1, 2, 3, 103101, 1160);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "小僧！\nシノブに触るとは\nいい度胸じゃねぇか！", 1, 2, 4, 103101, 1161);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あなたに触られると、\n動悸が早くなります\nもしかして心霊現象？", 1, 2, 101, 103101, 1162);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "今日もたくさんの幽霊\nに慕われていますね。\n素敵です", 1, 2, 102, 103101, 1163);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます\n今日の運勢を\n占いましょうか？", 1, 2, 1, 103101, 1164);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1, 2, 2, 103101, 1165);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "今日のあなたの運気は\n最高潮でした。\nもうすぐ今日は\n終わりますが", 1, 2, 3, 103101, 1166);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さん。\nいつも、身だしなみに\n気を使ってるけど、\nあまり変わってないよ", 1, 3, 1, 103101, 1167);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一休みしましょう。\n憑かれて疲れました", 1, 3, 2, 103101, 1168);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい…\n付喪神が宿らないかな", 1, 3, 3, 103101, 1169);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さん、\nリラックスし過ぎると\n成仏しちゃうよ？", 1, 3, 4, 103101, 1170);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "気持ちいいです…\n極楽浄土みたい…", 1, 3, 5, 103101, 1171);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1, 3, 6, 103101, 1172);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さんも\n食べたいの？\n死んでるのに？", 1, 3, 7, 103101, 1173);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この本…\nもしかして予言書？", 1, 3, 8, 103101, 1174);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここにいる幽霊は\nみんな幸せそうです", 1, 1, 1, 103102, 1176);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さんが\n女の子ばかりに\n声をかけるので\n困っています", 1, 1, 2, 103102, 1177);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "成仏はうれしいこと\nです…でも友達が\n減るのは寂しいですね", 1, 1, 3, 103102, 1178);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "幽霊に好かれる人は\n素敵な方です\nもちろん、あなたも", 1, 1, 4, 103102, 1179);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1, 1, 5, 103102, 1180);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "生きている人に\n好かれるには、\nどうすればいい\nのでしょう？", 1, 1, 101, 103102, 1181);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お父さん、どうしたら\nあの人のことを\n認めてくれますか？", 1, 1, 102, 103102, 1182);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋、風水的にも\n運気が上がりそうです", 1, 2, 1, 103102, 1183);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "シノブには指一本\n触れさせん！\nガブッ！！", 1, 2, 2, 103102, 1184);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1, 2, 3, 103102, 1185);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ラップ音？\nいえ、父のいびきです", 1, 2, 4, 103102, 1186);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 1, 2, 101, 103102, 1187);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "前世って信じますか？\n私とあなたは\nもしかすると…", 1, 2, 102, 103102, 1188);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1, 2, 1, 103102, 1189);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "明るい時間は\nあまり得意では\nないんです…", 1, 2, 2, 103102, 1190);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜のお散歩に\n行きませんか？\n知り合いの幽霊に\n挨拶して回るんです", 1, 2, 3, 103102, 1191);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さん\nいつも、身だしなみに\n気を使ってるけど\nあまり変わってないよ", 1, 3, 1, 103102, 1192);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うとうと…\nあれ…\n走馬灯が見える…", 1, 3, 2, 103102, 1193);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい…\nお父さんみたい…", 1, 3, 3, 103102, 1194);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さん\nリラックスし過ぎると\n成仏しちゃうよ？", 1, 3, 4, 103102, 1195);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "快適です…\n幽霊もどんどん\n集まってきますね…", 1, 3, 5, 103102, 1196);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1, 3, 6, 103102, 1197);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お父さんの分も、\n私が食べるね", 1, 3, 7, 103102, 1198);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この本の占い\n私の占いと違う…", 1, 3, 8, 103102, 1199);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私だって、一人で\n買い物ぐらい\nできますわ…きっと", 1, 1, 1, 103201, 1201);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1, 1, 2, 103201, 1202);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一日も早く、\n一人前の商人に\nなりたいものです", 1, 1, 3, 103201, 1203);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "平和を買うのには\nどれほどのお金が\n必要なのかしら？", 1, 1, 4, 103201, 1204);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？", 1, 1, 5, 103201, 1205);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1, 1, 101, 103201, 1206);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1, 1, 102, 103201, 1207);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私と、庶民向けの\nお店へ一緒に\n参りませんか？", 1, 2, 1, 103201, 1208);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "資産運用？\nお幾らほど\n増やしたいのです？", 1, 2, 2, 103201, 1209);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！", 1, 2, 3, 103201, 1210);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お金で解決するのは\n悪いことでは\nありませんわよね？", 1, 2, 4, 103201, 1211);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "その、よろしければ\n私とお散歩など\nいかがです？", 1, 2, 101, 103201, 1212);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "もしあなたさまが\n道に迷われるなら、\n私もお供いたします！", 1, 2, 102, 103201, 1213);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね", 1, 2, 1, 103201, 1214);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1, 2, 2, 103201, 1215);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1, 2, 3, 103201, 1216);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "だらしない身なりでは\n取引相手に信用して\nいただけませんものね", 1, 3, 1, 103201, 1217);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…", 1, 3, 2, 103201, 1218);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1, 3, 3, 103201, 1219);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！", 1, 3, 4, 103201, 1220);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1, 3, 5, 103201, 1221);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "健康はお金では\n買えませんが\n運動器具は別ですわ！", 1, 3, 6, 103201, 1222);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なかなか\n美味ですわ\nシェフはどちらに？", 1, 3, 7, 103201, 1223);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "経済の仕組みを\nしっかりと\n学ばなくては…", 1, 3, 8, 103201, 1224);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1, 1, 1, 103202, 1226);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ええと、これは\nおいくらで買ったん\nでしたっけ？", 1, 1, 2, 103202, 1227);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お金を見せたら\n態度が変わる人は\n信用できませんわ", 1, 1, 3, 103202, 1228);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね", 1, 1, 4, 103202, 1229);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この狭さも\n慣れれば\n快適ですわ♪", 1, 1, 5, 103202, 1230);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 1, 1, 101, 103202, 1231);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 1, 1, 102, 103202, 1232);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一人前の商人に\n相応しい居振る舞いを\nしたいものですわ", 1, 2, 1, 103202, 1233);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "幼い頃\nお店屋さんごっこを\nなさいましたか？", 1, 2, 2, 103202, 1234);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "資産運用？\nお幾らほど\n増やしたいのです？", 1, 2, 3, 103202, 1235);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今度一緒に…\nパーティにでも\n行きませんこと？", 1, 2, 4, 103202, 1236);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "その、よろしければ\n私とお散歩など\nいかがです？", 1, 2, 101, 103202, 1237);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あなたさまの優しさは\nお金には\n代えられませんわね", 1, 2, 102, 103202, 1238);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "なぜだか\n眠り足りないような\n感じがしますわ…", 1, 2, 1, 103202, 1239);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1, 2, 2, 103202, 1240);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1, 2, 3, 103202, 1241);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！", 1, 3, 1, 103202, 1242);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういったものに\n腰を沈めると…\nき、気が緩んで…", 1, 3, 2, 103202, 1243);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1, 3, 3, 103202, 1244);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "香りは質のいいものと\nそうでないものが\nはっきり分かりますわ", 1, 3, 4, 103202, 1245);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1, 3, 5, 103202, 1246);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "目標は遠くに\n置いた方が励みに\nなりますわ！", 1, 3, 6, 103202, 1247);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なかなか\n美味ですわ\nシェフはどちらに？", 1, 3, 7, 103202, 1248);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "商人って、物語では\n悪役にされやすいの\nですね…", 1, 3, 8, 103202, 1249);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "家の中のものを使って\n物ボケ、考えるべ！", 1, 1, 1, 103301, 1251);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！", 1, 1, 2, 103301, 1252);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うちに塀ができたら、\nへー、って言いたい！", 1, 1, 3, 103301, 1253);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ", 1, 1, 4, 103301, 1254);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "エリザベスも\n連れてきてぇ～", 1, 1, 5, 103301, 1255);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪", 1, 1, 101, 103301, 1256);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "オラとあんちゃん、\n息がぴったりに\nなってきたべ…！", 1, 1, 102, 103301, 1257);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！", 1, 2, 1, 103301, 1258);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？", 1, 2, 2, 103301, 1259);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1, 2, 3, 103301, 1260);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？", 1, 2, 4, 103301, 1261);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 1, 2, 101, 103301, 1262);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！", 1, 2, 102, 103301, 1263);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう！　一緒に\n牛の乳しぼりいくべ？", 1, 2, 1, 103301, 1264);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼だ～腹が減っては\n笑いはできぬ～！", 1, 2, 2, 103301, 1265);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！", 1, 2, 3, 103301, 1266);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！", 1, 3, 1, 103301, 1267);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ナイスなイスに\n座りたい、\nなんちゃって！", 1, 3, 2, 103301, 1268);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "めんこいのは、\nスベっても許される\nからずるいべな～？", 1, 3, 3, 103301, 1269);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "必要以上に\n癒されちまうべや～", 1, 3, 4, 103301, 1270);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぽかぽかだ…\nウケた会場みてぇだ", 1, 3, 5, 103301, 1271);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お笑い芸人は、\n体が資本だべさ～！", 1, 3, 6, 103301, 1272);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1, 3, 7, 103301, 1273);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ネタ作りのヒントが\n載ってねぇか探すべ", 1, 3, 8, 103301, 1274);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さぁ今日も張り切って\n漫才の練習するべさ！", 1, 1, 1, 103302, 1276);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋でも、商品\n売っていいんだべか？", 1, 1, 2, 103302, 1277);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？", 1, 1, 3, 103302, 1278);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ", 1, 1, 4, 103302, 1279);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "エリザベスも\n連れてきてぇ～", 1, 1, 5, 103302, 1280);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 1, 1, 101, 103302, 1281);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あんちゃんに\n採れたての食材を\n食わしてやりてぇ～", 1, 1, 102, 103302, 1282);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？", 1, 2, 1, 103302, 1283);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんちゃん、百連\nツッコミ特訓だ～！", 1, 2, 2, 103302, 1284);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1, 2, 3, 103302, 1285);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「なんでだべ～！」\nって言いながら\nツッコむといいべ！", 1, 2, 4, 103302, 1286);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～", 1, 2, 101, 103302, 1287);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！", 1, 2, 102, 103302, 1288);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう！\n今日もいい\nネタ作り日和だ！", 1, 2, 1, 103302, 1289);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼だな\nご飯を食べたら、\nネタの練習するべ！", 1, 2, 2, 103302, 1290);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "もうこんな時間だべ\nネタ作りは\n明日にするべ…", 1, 2, 3, 103302, 1291);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うーん…衣装、\nずれてねぇべか？", 1, 3, 1, 103302, 1292);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ナイスなイスに\n座りたい\nなんちゃって！", 1, 3, 2, 103302, 1293);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はう～\nなまらめんこいべや～", 1, 3, 3, 103302, 1294);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "必要以上に\n癒されちまうべや～", 1, 3, 4, 103302, 1295);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "笑いをとることを\n忘れるほど\nあったけぇべ～", 1, 3, 5, 103302, 1296);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！", 1, 3, 6, 103302, 1297);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1, 3, 7, 103302, 1298);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "幅広く教養を\n身につけて\nいいネタ作るべ！", 1, 3, 8, 103302, 1299);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "通りにいる\nカップル…爆発\nすればいいのに…", 1, 1, 1, 103401, 1301);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "う～ん、仕事なんて\nしないで、\n飲んでたいな～", 1, 1, 2, 103401, 1302);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日は一日、\n外に出ない！\nもう決めたわ！", 1, 1, 3, 103401, 1303);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お腹空いた…\nけど、外に出るのは\n面倒だなぁ", 1, 1, 4, 103401, 1304);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…", 1, 1, 5, 103401, 1305);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "デートとか…\n誘っても嫌がられ\nないかな…？", 1, 1, 101, 103401, 1306);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "もしかして運命の\n相手だったり…\nするのかな", 1, 1, 102, 103401, 1307);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？", 1, 2, 1, 103401, 1308);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "頼れるお姉さんだって\nところ、もっと見せて\nあげるからね", 1, 2, 2, 103401, 1309);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…", 1, 2, 3, 103401, 1310);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～", 1, 2, 4, 103401, 1311);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 1, 2, 101, 103401, 1312);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "いつか…\nキミと一緒に飲めたら\n楽しいだろうな", 1, 2, 102, 103401, 1313);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…", 1, 2, 1, 103401, 1314);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "おっひるー♪\nなに食べよっかな～♪", 1, 2, 2, 103401, 1315);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ふわあ…\n眠る前にちょっと\n一杯…冗談よ", 1, 2, 3, 103401, 1316);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うう…\n髪がボサボサ…\nちゃんとしなきゃ…", 1, 3, 1, 103401, 1317);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1, 3, 2, 103401, 1318);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういうの男の子に\nプレゼントして\nもらいたいな…", 1, 3, 3, 103401, 1319);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うわあ、\nこれ、私の好きな\n香りだー！", 1, 3, 4, 103401, 1320);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぽっかぽか…\nあとは熱い一杯が\nあれば…！", 1, 3, 5, 103401, 1321);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！", 1, 3, 6, 103401, 1322);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…\nおーいしー！\n…太らないよね？", 1, 3, 7, 103401, 1323);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1, 3, 8, 103401, 1324);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仕事終わりの一杯の\nために、今日も\n頑張らないと", 1, 1, 1, 103402, 1326);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日は\nのんびり\n過ごそうかな～", 1, 1, 2, 103402, 1327);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ…\nお皿、洗って\nなかった…", 1, 1, 3, 103402, 1328);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もう少し、大人の\n魅力が出せるように\nなりたいな", 1, 1, 4, 103402, 1329);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "素敵な彼氏…\n欲しいなぁ…", 1, 1, 5, 103402, 1330);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "彼と私\n釣り合うかな…\n大丈夫よね？", 1, 1, 101, 103402, 1331);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "今後のために\nちょっとは花嫁修業\nしてみようかな…？", 1, 1, 102, 103402, 1332);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何事も\nお姉さんと一緒に\n楽しく頑張りましょ？", 1, 2, 1, 103402, 1333);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ね、ねえ！\nキミは年上と年下\nどっちが好きかな？", 1, 2, 2, 103402, 1334);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もう…\n構ってくれないと\n泣いちゃうぞ～？", 1, 2, 3, 103402, 1335);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姉さんが～\n可愛がって\nあげようか～？", 1, 2, 4, 103402, 1336);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 1, 2, 101, 103402, 1337);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お姉さんとチュー\nする？　ふふふ～\n冗談で～す！", 1, 2, 102, 103402, 1338);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "さーて、今日も\nいっちょやるぞー！", 1, 2, 1, 103402, 1339);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "後でのんびり\nストレッチでも\nしようっと♪", 1, 2, 2, 103402, 1340);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "一日よく働いた～！\n自分にごほうび\nあげたいなー♪", 1, 2, 3, 103402, 1341);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仕事の前に、髪とか\n整えないと…", 1, 3, 1, 103402, 1342);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1, 3, 2, 103402, 1343);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もう大人だし…\nあんまり可愛いのは\n似合わないかな…？", 1, 3, 3, 103402, 1344);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うわあ\nこれ、私の好きな\n香りだー！", 1, 3, 4, 103402, 1345);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったかーい…\nだ、だらけ\nちゃいそう…", 1, 3, 5, 103402, 1346);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "地道な努力が\nリア充への\n第一歩！", 1, 3, 6, 103402, 1347);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おーいしっ♪\nこのために\n生きてるわねえ", 1, 3, 7, 103402, 1348);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1, 3, 8, 103402, 1349);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1, 1, 1, 103801, 1351);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？", 1, 1, 2, 103801, 1352);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1, 1, 3, 103801, 1353);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちょっと、休憩…\n本でも読もうかな", 1, 1, 4, 103801, 1354);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もっとたくさんの本に\n囲まれて生活したいな", 1, 1, 5, 103801, 1355);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "むかしむかしある所に\nシオリと\nあの人が…", 1, 1, 101, 103801, 1356);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "この本の主人公、\nあの人に\n似ているかも…\nかっこいいな", 1, 1, 102, 103801, 1357);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1, 2, 1, 103801, 1358);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ…お姉ちゃんと\n約束があったんだ…", 1, 2, 2, 103801, 1359);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1, 2, 3, 103801, 1360);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1, 2, 4, 103801, 1361);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "読みたい本も\nあなたと行きたい所も\n増えるばっかりです", 1, 2, 101, 103801, 1362);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 1, 2, 102, 103801, 1363);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1, 2, 1, 103801, 1364);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ふぅ…午前中\n動いたので体力が…\nすこし休みますね", 1, 2, 2, 103801, 1365);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…", 1, 2, 3, 103801, 1366);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "寝てばかりなので、\n髪が乱れてないかな\n…？", 1, 3, 1, 103801, 1367);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "少し休もう\n…やっぱり\nたくさん休もう", 1, 3, 2, 103801, 1368);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいいものが\n枕元にあると\n安心できるんですよ", 1, 3, 3, 103801, 1369);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り…\n病は気からと言うので\n雰囲気も大事ですね", 1, 3, 4, 103801, 1370);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こうして温まって\nいると、病気も\n治る気がします", 1, 3, 5, 103801, 1371);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…", 1, 3, 6, 103801, 1372);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "少食ですけど\nこれならたくさん\n食べられそうです", 1, 3, 7, 103801, 1373);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "続きが気になって\n読むのを止める\nタイミングが…", 1, 3, 8, 103801, 1374);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "しっかり休まないと\n早く回復するように", 1, 1, 1, 103802, 1376);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？　", 1, 1, 2, 103802, 1377);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "病室よりも…\nずっとこの部屋に\nいたいですね…　", 1, 1, 3, 103802, 1378);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1, 1, 4, 103802, 1379);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1, 1, 5, 103802, 1380);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "むかしむかしある所に\nシオリと\nあの人が…", 1, 1, 101, 103802, 1381);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あの人の\nためにも早く\n病気を治さないと…", 1, 1, 102, 103802, 1382);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1, 2, 1, 103802, 1383);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新記録です！\n一週間連続、\n平熱を保ちました！", 1, 2, 2, 103802, 1384);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ…お薬の時間…\n苦いけど我慢しなきゃ　", 1, 2, 3, 103802, 1385);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1, 2, 4, 103802, 1386);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1, 2, 101, 103802, 1387);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 1, 2, 102, 103802, 1388);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1, 2, 1, 103802, 1389);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "…お昼の薬？\nあ、飲み忘れてました\nありがとうございます", 1, 2, 2, 103802, 1390);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～", 1, 2, 3, 103802, 1391);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "寝てばかりなので、\n髪が乱れてないかな\n…？　", 1, 3, 1, 103802, 1392);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "少し休もう\n…やっぱり\nたくさん休もう", 1, 3, 2, 103802, 1393);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この子がいれば\n病室に一人でも\n寂しくないですね", 1, 3, 3, 103802, 1394);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いろんな効能が？\n健康になる香りも\nあるのでしょうか？", 1, 3, 4, 103802, 1395);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こうして温まって\nいると、病気も\n治る気がします", 1, 3, 5, 103802, 1396);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私も、少しは\n体力をつけないと\nいけませんよね　", 1, 3, 6, 103802, 1397);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いっぱい食べて\n健康な体にならないと", 1, 3, 7, 103802, 1398);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "続きが気になって\n読むのを止める\nタイミングが…", 1, 3, 8, 103802, 1399);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "友達ができたら、\n山の上でお弁当…\n夢が広がります…", 1, 1, 1, 104001, 1401);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、忘れずに\nお花に水を\nあげなきゃ…", 1, 1, 2, 104001, 1402);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…", 1, 1, 3, 104001, 1403);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そろそろ新しい\n草人形を作って\n友達作りの特訓を…", 1, 1, 4, 104001, 1404);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "植物のお世話って、\nぼっちにとっては、\n救い…なんです…", 1, 1, 5, 104001, 1405);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ＢＢ団の活動日…\nまだかな…\nうふふふっ", 1, 1, 101, 104001, 1406);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1, 1, 102, 104001, 1407);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、こんにちは！\n今日もＢＢ団で\nお世話になります！", 1, 2, 1, 104001, 1408);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの…私の友達作りの\n練習方法、間違って\nませんよね…？", 1, 2, 2, 104001, 1409);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？", 1, 2, 3, 104001, 1410);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！", 1, 2, 4, 104001, 1411);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！", 1, 2, 101, 104001, 1412);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 1, 2, 102, 104001, 1413);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます！\n今日もＢＢ団、\nがんばるぞー！", 1, 2, 1, 104001, 1414);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "なんだか、お腹が\n空いてきました。\nお昼ごはんー♪", 1, 2, 2, 104001, 1415);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "もう眠いかもです…\n明日は友達、\nできるといいなあ…", 1, 2, 3, 104001, 1416);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私がもっと\n可愛ければ、\n友達できるかなあ？", 1, 3, 1, 104001, 1417);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふわあ…のんびり\nしすぎないように\n気を付けなきゃです", 1, 3, 2, 104001, 1418);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいいなあ。\nこの子とも\n友達になりたい…", 1, 3, 3, 104001, 1419);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香りです…\n精神統一して\n友達のイメトレ…", 1, 3, 4, 104001, 1420);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "灯りを見てると、\n心がなごみます～", 1, 3, 5, 104001, 1421);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1, 3, 6, 104001, 1422);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしいです…\n私に友達がいたら、\n分けてあげたいな", 1, 3, 7, 104001, 1423);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1, 3, 8, 104001, 1424);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "友達作りは、焦らず\n慌てず、じっくりと…", 1, 1, 1, 104002, 1426);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ひとつ屋根の下\nって感じ…\nいいですねえ…", 1, 1, 2, 104002, 1427);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "煮汁、煮汁が\n噴きこぼれて\nいませんか～", 1, 1, 3, 104002, 1428);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今度、みなさんと\nピクニックとか…\nいってみたいな", 1, 1, 4, 104002, 1429);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぼっちでもいい\nたくましく育てば\n…なんて", 1, 1, 5, 104002, 1430);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…", 1, 1, 101, 104002, 1431);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 1, 1, 102, 104002, 1432);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！", 1, 2, 1, 104002, 1433);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！", 1, 2, 2, 104002, 1434);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私少しは人と話しても\nテンパらなくなって\nきましたかね…？", 1, 2, 3, 104002, 1435);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あの、友達作りの\n新しい作戦\n考えてみたんですっ！", 1, 2, 4, 104002, 1436);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ", 1, 2, 101, 104002, 1437);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 1, 2, 102, 104002, 1438);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝ですね！\nこんないい朝は\n友達作りのチャンス！", 1, 2, 1, 104002, 1439);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "あの…そろそろお腹\nすきませんか？\nお昼ごはんは…", 1, 2, 2, 104002, 1440);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "もう眠いかもです…\n明日は友達\nできるといいなあ…", 1, 2, 3, 104002, 1441);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私…見た目\nそこまで変じゃ\nないですよね…？", 1, 3, 1, 104002, 1442);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ほわあ～…\nふかふかって\nいいものですね～", 1, 3, 2, 104002, 1443);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この子みたいな\nあいくるしさを\n目指したいです！", 1, 3, 3, 104002, 1444);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "灯りを見てると\n心がなごみます～", 1, 3, 4, 104002, 1445);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぬくぬくで、なんだか\n眠くなっちゃいますね", 1, 3, 5, 104002, 1446);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身体を鍛えて\nみなさんを\n守ります！", 1, 3, 6, 104002, 1447);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1, 3, 7, 104002, 1448);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1, 3, 8, 104002, 1449);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "唱喚の歌は、みだりに\n歌っていいものでは\nないんです", 1, 1, 1, 104201, 1451);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここでアイドルの\n練習は、さすがに\n迷惑ですよね？", 1, 1, 2, 104201, 1452);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1, 1, 3, 104201, 1453);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "人々の平和を守る旅に\n同行してくれる人を\n探していて…", 1, 1, 4, 104201, 1454);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あとで曲を復習して\nおかないと…", 1, 1, 5, 104201, 1455);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…", 1, 1, 101, 104201, 1456);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1, 1, 102, 104201, 1457);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1, 2, 1, 104201, 1458);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "え、もう練習の時間？\nごめんなさい\nすぐ準備します！", 1, 2, 2, 104201, 1459);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1, 2, 3, 104201, 1460);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1, 2, 4, 104201, 1461);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 1, 2, 101, 104201, 1462);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 1, 2, 102, 104201, 1463);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます♪\n少し歌の練習を\nしてきますね", 1, 2, 1, 104201, 1464);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "もうお昼なんですか？\n練習に夢中で\n気づきませんでした", 1, 2, 2, 104201, 1465);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "明日の予定は…\nアイドルはやることが\n多いみたいで…", 1, 2, 3, 104201, 1466);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1, 3, 1, 104201, 1467);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "歌の調子をよくする\nためには休息も\n必要ですよね…", 1, 3, 2, 104201, 1468);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この子たちを\n相手に練習して\nみようかな…♪", 1, 3, 3, 104201, 1469);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1, 3, 4, 104201, 1470);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1, 3, 5, 104201, 1471);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "歌うためには\n体力づくりは\n欠かせません", 1, 3, 6, 104201, 1472);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "歌った後は\nお腹が空いて\nしまうんです", 1, 3, 7, 104201, 1473);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "音楽について\n理論も勉強\nしないと…", 1, 3, 8, 104201, 1474);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "歌うことの楽しさ\n分かってきました\nもっと歌いたいな…", 1, 1, 1, 104202, 1476);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1, 1, 2, 104202, 1477);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "精霊も強くなったし\nもっとたくさんの人を\n守りたいです", 1, 1, 3, 104202, 1478);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…", 1, 1, 4, 104202, 1479);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "楽譜を買いました\n思いついた歌を\n書き留めておくために", 1, 1, 5, 104202, 1480);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 1, 1, 101, 104202, 1481);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私の中にある\n私だけの歌…\n作ってみようかな？", 1, 1, 102, 104202, 1482);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1, 2, 1, 104202, 1483);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1, 2, 2, 104202, 1484);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "魔物退治ですか！？\n…違います？\n良かった…", 1, 2, 3, 104202, 1485);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1, 2, 4, 104202, 1486);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 1, 2, 101, 104202, 1487);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 1, 2, 102, 104202, 1488);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ", 1, 2, 1, 104202, 1489);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "少し休んだら\n午後の練習に\n行ってきますね", 1, 2, 2, 104202, 1490);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "曲を作っていたら\nもうこんな時間…\nおやすみなさい", 1, 2, 3, 104202, 1491);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1, 3, 1, 104202, 1492);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです", 1, 3, 2, 104202, 1493);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね", 1, 3, 3, 104202, 1494);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1, 3, 4, 104202, 1495);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1, 3, 5, 104202, 1496);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もっと体力をつけて\n最高のライブを\nファンに届けます！", 1, 3, 6, 104202, 1497);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これでも一応\n体形には気をつけて\n食べてるんですよ？", 1, 3, 7, 104202, 1498);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "読書は歌に\n新しい風を\n吹き込んでくれます", 1, 3, 8, 104202, 1499);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "店の新メニューでも\n考えるかな", 1, 1, 1, 104301, 1501);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたしの店から、\n出前を届けようか？", 1, 1, 2, 104301, 1502);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "パトロール、\nパトロール…\nここは異常なしかな？", 1, 1, 3, 104301, 1503);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1, 1, 4, 104301, 1504);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "のんびりし過ぎるのも\n…性に合わねぇな", 1, 1, 5, 104301, 1505);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "そろそろあいつ、\n腹すかしてるん\nじゃないかな？", 1, 1, 101, 104301, 1506);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1, 1, 102, 104301, 1507);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ", 1, 2, 1, 104301, 1508);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "天気がいい日は\n外で運動したく\nならねぇか？", 1, 2, 2, 104301, 1509);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "腹減ったか？　なんか\n作ってやろうか？", 1, 2, 3, 104301, 1510);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん？　なんだよ、\n相談事か？\nなんでも言ってくれ", 1, 2, 4, 104301, 1511);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "お前が好きな飯って\nなんだ？\n今度、作ってやるよ", 1, 2, 101, 104301, 1512);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 1, 2, 102, 104301, 1513);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか", 1, 2, 1, 104301, 1514);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1, 2, 2, 104301, 1515);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな", 1, 2, 3, 104301, 1516);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "た、たまにはその…\nかわいい格好とか\nしても…", 1, 3, 1, 104301, 1517);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふわぁ、\n一休みすっかなぁ～", 1, 3, 2, 104301, 1518);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うっ！　か、かわいい\nじゃねぇか", 1, 3, 3, 104301, 1519);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1, 3, 4, 104301, 1520);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふわぁ〜！\n温かいと、つい\nウトウトしちまうな", 1, 3, 5, 104301, 1521);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "オラオラオラーーー！\n燃えるぜーーー！", 1, 3, 6, 104301, 1522);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1, 3, 7, 104301, 1523);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ", 1, 3, 8, 104301, 1524);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "パトロール終了～\n本日も異常なしっと！", 1, 1, 1, 104302, 1526);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたしの店から\n出前を届けようか？", 1, 1, 2, 104302, 1527);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あいつ、早く\n帰ってこないかな", 1, 1, 3, 104302, 1528);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あいつ\n腹すかせてないと\nいいんだけど…", 1, 1, 4, 104302, 1529);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "のんびりし過ぎるのも\n…性に合わねぇな", 1, 1, 5, 104302, 1530);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あいつの事を思うと\n胸があったかくなる？\nなんだコレ…？", 1, 1, 101, 104302, 1531);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "今日の献立は…\nあいつの好きなものに\nしてやるか", 1, 1, 102, 104302, 1532);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん？　なんだよ\n相談事か？\nなんでも言ってくれ", 1, 2, 1, 104302, 1533);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "天気がいい日は\n外で運動したく\nならねぇか？", 1, 2, 2, 104302, 1534);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "腹減ったか？　なんか\n作ってやろうか？", 1, 2, 3, 104302, 1535);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1, 2, 4, 104302, 1536);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あのさ…できれば\nもっとそばに…いや\nなんでもねぇ忘れろ！", 1, 2, 101, 104302, 1537);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 1, 2, 102, 104302, 1538);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか？", 1, 2, 1, 104302, 1539);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1, 2, 2, 104302, 1540);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "あんま夜更しすんなよ\n明日に響いたら\n大変だろ？", 1, 2, 3, 104302, 1541);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "た、たまにはその…\nかわいい格好とか\nしても…", 1, 3, 1, 104302, 1542);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふぅ～♪\n疲れがとれるな～", 1, 3, 2, 104302, 1543);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うっ！　か、かわいい\nじゃねぇか", 1, 3, 3, 104302, 1544);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1, 3, 4, 104302, 1545);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふわぁ～！\n温かいと、つい\nウトウトしちまうな", 1, 3, 5, 104302, 1546);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "オラオラオラーーー！\n燃えるぜーーー！", 1, 3, 6, 104302, 1547);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1, 3, 7, 104302, 1548);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "料理だけじゃなく\n経営術とかも\n学んどかねぇと…", 1, 3, 8, 104302, 1549);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近なにも\nしてくれません…\n焦らしてるんですね", 1, 1, 1, 104501, 1551);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぐふふ、じゅるり…\nい、いけない、また\nいつの間にかよだれが", 1, 1, 2, 104501, 1552);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "好きな武器といえば\n剣より槍より\nやっぱり鞭…ぐふふ", 1, 1, 3, 104501, 1553);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「無数の触手が\nクウカの柔肌に\n食い込み」…ぐふふ", 1, 1, 4, 104501, 1554);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1, 1, 5, 104501, 1555);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ドＳさんを登場\nさせるだけで、妄想に\n無限の広がりが！", 1, 1, 101, 104501, 1556);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1, 1, 102, 104501, 1557);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "視線を感じると\n思ったら…やはり\nドＳさんでしたか", 1, 2, 1, 104501, 1558);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日は\nどんなヒドイことを\nしてくれるんですか？\nぐふふふ", 1, 2, 2, 104501, 1559);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いつの間にそこに！？\nまさかクウカを監視\nしていたのですか！？", 1, 2, 3, 104501, 1560);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "クウカに触るつもり\nですか？　触るつもり\nなのですねっ！？", 1, 2, 4, 104501, 1561);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "クウカにナニをする\nつもりですか…\n期待してしまいます！", 1, 2, 101, 104501, 1562);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ドＳさんの視界に入る\nだけでドキドキが…\nこれが恋！？", 1, 2, 102, 104501, 1563);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはようございます。\n朝からお盛んですね？\nぐふふ…", 1, 2, 1, 104501, 1564);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "こんなにも日の高い\nうちからドＳさんは…\nじゅるり", 1, 2, 2, 104501, 1565);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜はこれから、\nですよ…\nぐふ、ぐふふふ…", 1, 2, 3, 104501, 1566);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "キレイにおめかし\nしたのに力ずくで…\nぐふふふ", 1, 3, 1, 104501, 1567);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ソファの背にクウカを\n押し付けて…ぐふふ\nいいですね\nソファドン", 1, 3, 2, 104501, 1568);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1, 3, 3, 104501, 1569);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "香りを吸ったクウカの\n頬は紅潮し目はうるみ\nもはや抗う力も…！", 1, 3, 4, 104501, 1570);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ああ、身体が\n火照って…\nぐふ、ぐふふ…", 1, 3, 5, 104501, 1571);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ、はぁ、こうして\nクウカの体力を\n奪ってから…ぐふふ", 1, 3, 6, 104501, 1572);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "食欲が満たされたら\nつ、次はやはり…！\nそうなのですね！？", 1, 3, 7, 104501, 1573);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この本の下に、\nそういう本を\nカムフラージュ？", 1, 3, 8, 104501, 1574);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「ドＳさんと踊り子\n乱舞の一夜」…\n次の日記はこれで…", 1, 1, 1, 104502, 1576);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "最近なにも\nしてくれません…\n焦らしてるんですね", 1, 1, 2, 104502, 1577);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "も、妄想が\n足りません…\n禁断症状がっ…！", 1, 1, 3, 104502, 1578);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1, 1, 4, 104502, 1579);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "次はどんなドＳを\nされるのか、想像する\nだけで…ぐふふふ", 1, 1, 5, 104502, 1580);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "じっとしてると\nドＳさんのことばかり\n考えてしまいますね", 1, 1, 101, 104502, 1581);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "妄想が止まらなくて\nクウカどうにかなって\nしまいそうです！", 1, 1, 102, 104502, 1582);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ドＳさんといると体が\n火照って…クウカは\nいやらしい子です！", 1, 2, 1, 104502, 1583);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1, 2, 2, 104502, 1584);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ドＳさんのおかげで\n新しい扉が開けそう\nです…じゅるり", 1, 2, 3, 104502, 1585);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いやー！　ドＳさんに\n襲われ…襲って\nくれないんですか？", 1, 2, 4, 104502, 1586);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "クウカはドＳさんに\n身も心も堕とされて\nしまったのですね", 1, 2, 101, 104502, 1587);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ドＳさんがお望みなら\nクウカは\nどんなことだって！", 1, 2, 102, 104502, 1588);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝だからこそ\nできる妄想が\nあります…ぐふふ", 1, 2, 1, 104502, 1589);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "こんな日の高いうち\nからドＳさんは…\nじゅるり", 1, 2, 2, 104502, 1590);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "今夜は一晩中…\nなんですね？\nぐふふ…", 1, 2, 3, 104502, 1591);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "意外と難しいんですよ\n正しい亀甲縛りと\nいうものは…", 1, 3, 1, 104502, 1592);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "くつろいで油断\nしているスキに何を\nされるのでしょう！？", 1, 3, 2, 104502, 1593);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1, 3, 3, 104502, 1594);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これは禁断の香り…\nああっ一段階上の\n妄想が開花するうぅ！", 1, 3, 4, 104502, 1595);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ああっ、暖気がまるで\nロウソクのように\nクウカを攻めますっ！", 1, 3, 5, 104502, 1596);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "激しい攻めを受けきる\nためには、鍛えないと\nいけないのですね", 1, 3, 6, 104502, 1597);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こんなにいっぱい\n入りません…\nお腹にっ！", 1, 3, 7, 104502, 1598);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どんな本も\nよく見ると\nいやらしいです…！", 1, 3, 8, 104502, 1599);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この前遊んだ猫、\nモッフモフ\nだったにゃあ…♪", 1, 1, 1, 104601, 1601);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ほっぺやお腹が、\n肉球ぐらいぷにぷに…\nこれはまずいにゃ…", 1, 1, 2, 104601, 1602);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "大きな仕事が\n決まったにゃ！\n腕が鳴るにゃ～♪", 1, 1, 3, 104601, 1603);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おやつのたい焼き、\nつぶあんとこしあん、\nどっちに\nしようかにゃ？", 1, 1, 4, 104601, 1604);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うにゃー…\nもうちょっとお昼寝\nしたかったにゃ…\nむにゃむにゃ…", 1, 1, 5, 104601, 1605);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "キミに呼ばれると、\n猫まっしぐらな気分に\nなっちゃうにゃ♪", 1, 1, 101, 104601, 1606);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミのおかげで\nギルドの仕事も\n大成功だにゃ♪\nありがとにゃ♪", 1, 1, 102, 104601, 1607);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うずうず…その指、\nじゃれついても\nいいかにゃ？", 1, 2, 1, 104601, 1608);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にゃ？　あたしに何か\nご入り用かにゃ？\nお安くしとくにゃ～♪", 1, 2, 2, 104601, 1609);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うーん、なんだか\n退屈にゃ～\n遊んで、遊んで～？", 1, 2, 3, 104601, 1610);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "素早い動きのコツ？\nタダじゃ教えて\nあげられないにゃ～♪", 1, 2, 4, 104601, 1611);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "そんなにあたしを\nなでたいにゃ？\nキミならなでさせて\nあげてもいいかにゃー", 1, 2, 101, 104601, 1612);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ふにゃあ、ねえねえ、\n一緒にゴロゴロ\nしようにゃあ？", 1, 2, 102, 104601, 1613);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1, 2, 1, 104601, 1614);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "むーん、そろそろ\nお昼…猫たちにも\n猫缶を…", 1, 2, 2, 104601, 1615);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ふわあ…眠いにゃ…\n猫は布団で\n丸くなるにゃ", 1, 2, 3, 104601, 1616);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "客商売では、\n外見のチェックも\n欠かせないのにゃ！", 1, 3, 1, 104601, 1617);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うにゃ～！\nお昼寝に\nぴったりにゃ", 1, 3, 2, 104601, 1618);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ…量産したら\n子どもにバカ売れ\nしそうだにゃ！", 1, 3, 3, 104601, 1619);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この灯り、まるで\n猫みたいな\n癒し効果にゃ！", 1, 3, 4, 104601, 1620);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふにゃあ、\nあったかいと猫は丸く\nなっちゃうのにゃあ…", 1, 3, 5, 104601, 1621);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "本当は外で\n運動したいん\nだけどにゃ", 1, 3, 6, 104601, 1622);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "むーん、\n美味しいにゃー！\nたい焼きに\n匹敵するにゃ！", 1, 3, 7, 104601, 1623);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふむふむ…猫の\nしつけ方は、と…", 1, 3, 8, 104601, 1624);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいいネコの置物を\nゲットしたにゃ！\nどこに飾ろうか\nにゃ～♪", 1, 1, 1, 104602, 1626);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仕事の交渉がうまく\n行ったにゃ～♪\nいい気分だにゃ～♪", 1, 1, 2, 104602, 1627);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねこじゃらしには\n食いついちゃうにゃ\nびしっ！　びしっ！", 1, 1, 3, 104602, 1628);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ほっぺやお腹が、肉球\nぐらいぷにぷに…\nこれはまずいにゃ…", 1, 1, 4, 104602, 1629);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "さっきのたいやき\nおいしかったにゃ♪\nごろごろごろ…", 1, 1, 5, 104602, 1630);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "手作りのたい焼き\nあいつは食べて\nくれるかにゃ…？", 1, 1, 101, 104602, 1631);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あいつには、いつか\nたっぷり恩返しが\nしたいにゃ…", 1, 1, 102, 104602, 1632);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にゃーに？　あたしの\nことがそんなに気に\nなるのかにゃ？", 1, 2, 1, 104602, 1633);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたしのこと…\nしっかり捕まえ\nといてにゃ？", 1, 2, 2, 104602, 1634);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたしの力が\n必要かにゃ？　猫の手\n貸してあげるにゃ♪", 1, 2, 3, 104602, 1635);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "たいやきとクレープを\n合わせれば…\n新しい商売のニオイが\nするにゃ…！", 1, 2, 4, 104602, 1636);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ふにゃあ、ねえねえ\n一緒にゴロゴロ\nしようにゃあ？", 1, 2, 101, 104602, 1637);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミと一緒にいると\n楽しくなってつい\nじゃれちゃうにゃ！", 1, 2, 102, 104602, 1638);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1, 2, 1, 104602, 1639);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "そろそろおっひる～\nにゃーんか\n食べたい…", 1, 2, 2, 104602, 1640);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "うーん、眠くなって\nきたにゃ。あたしは\n夜行性じゃないのにゃ", 1, 2, 3, 104602, 1641);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "にゃにゃ…\n髪が乱れてるにゃ", 1, 3, 1, 104602, 1642);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふっかふかにゃ～\n猫がねころん\nじゃうにゃ", 1, 3, 2, 104602, 1643);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ、猫と匹敵する\nぐらいかわいいにゃ！", 1, 3, 3, 104602, 1644);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "猫でもこわくない\n優しい灯りにゃ！", 1, 3, 4, 104602, 1645);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぽっかぽか\nしあわせな気分にゃ～", 1, 3, 5, 104602, 1646);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "雨の日でも運動\nできるのは、濡れ\nなくて便利だにゃ！", 1, 3, 6, 104602, 1647);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美味しいにゃ～！\nこれ、朝昼晩\n食べたいにゃ！", 1, 3, 7, 104602, 1648);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "本を読んで\n猫の気持ちを\n勉強するのにゃ！", 1, 3, 8, 104602, 1649);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "内職手伝える人\nいないかしら？", 1, 1, 1, 104801, 1651);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "次の依頼は、\nこういう計画で…\nうん、完璧ね！", 1, 1, 2, 104801, 1652);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "次の特売セールに\n向けて、しっかり\n準備しないと！", 1, 1, 3, 104801, 1653);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "配達の後に売り子\n次に採取のバイト…\nうん、効率的ね", 1, 1, 4, 104801, 1654);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一日に受ける\nバイトの数、もう少し\n増やしたいわね", 1, 1, 5, 104801, 1655);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "師匠として\n頼りにされたいし\nもっと頑張らなきゃ！", 1, 1, 101, 104801, 1656);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1, 1, 102, 104801, 1657);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あら、\nちょうどよかった\n今から一緒に\nバイトでもどう？", 1, 2, 1, 104801, 1658);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "相談事かしら？\nそれくらいなら\n無料でいいわよ", 1, 2, 2, 104801, 1659);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "背後の気配なら\nすぐ分かるわ\n試してみる？", 1, 2, 3, 104801, 1660);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "道具やお金の管理は\n大丈夫？　手伝うから\nいつでも言って", 1, 2, 4, 104801, 1661);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 1, 2, 101, 104801, 1662);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ねえ、あの…\n私はキミにとって…\nいや、何でもないわ", 1, 2, 102, 104801, 1663);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう！\n今日も朝から\nバイトよ！", 1, 2, 1, 104801, 1664);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼時ね。\n少し休憩したら、\nまた働くわよ！", 1, 2, 2, 104801, 1665);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1, 2, 3, 104801, 1666);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "接客業の依頼が\nある時は、外見も\nキレイにしないとね", 1, 3, 1, 104801, 1667);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ～バイトで\n疲れたから癒される～", 1, 3, 2, 104801, 1668);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これを内職で\n作ったら\n儲かるかしら？", 1, 3, 3, 104801, 1669);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リフレッシュできたわ\nこれでまた、バリバリ\n働けるわね！", 1, 3, 4, 104801, 1670);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "風邪を引いたら効率が\n落ちちゃうから、\n暖めないと！", 1, 3, 5, 104801, 1671);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "働き続けるには\n健康第一！　それには\n運動が一番よ", 1, 3, 6, 104801, 1672);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…\n腹が減っては\n戦ができぬ、よ！", 1, 3, 7, 104801, 1673);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "日々絶えず学んで、\n生活に活かすのよ！", 1, 3, 8, 104801, 1674);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "家計簿をつけなきゃ！\n覚えている時に\nやっておかないとね", 1, 1, 1, 104802, 1676);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "次の依頼は\nこういう計画で…\nうん、完璧ね！", 1, 1, 2, 104802, 1677);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ギルドの経費\nあとちょっとだけ\n削れそうね…", 1, 1, 3, 104802, 1678);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "少しでも時給のいい\nバイトがしたいけど\nなかなか\n出会えないのよ", 1, 1, 4, 104802, 1679);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今度のバイトも\nなかなか大変そう\nね…腕が鳴るわ", 1, 1, 5, 104802, 1680);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 1, 1, 101, 104802, 1681);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私、どうしたんだろ？\n仕事中もずっと\n彼のこと考えてる…", 1, 1, 102, 104802, 1682);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この間はヘルプに\n来てくれてありがとう\n頼んで正解だったわ", 1, 2, 1, 104802, 1683);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "見つけた！　ちょうど\n頼みたいことが\nあるんだけど、いい？", 1, 2, 2, 104802, 1684);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今から\n休憩するところなの\n一緒にどう？", 1, 2, 3, 104802, 1685);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん？　どうしたの？\n私のことが\n気になるの？", 1, 2, 4, 104802, 1686);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "…たまには甘えても\nいい？　私だって\n弱る時はあるのよ", 1, 2, 101, 104802, 1687);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 1, 2, 102, 104802, 1688);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう！\nいい朝ね。一緒に\nランニングでもいく？", 1, 2, 1, 104802, 1689);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼時ね\n少し休憩したら\nまた働くわよ！", 1, 2, 2, 104802, 1690);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1, 2, 3, 104802, 1691);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "女の子らしく…\nどうも忘れちゃう\nのよね", 1, 3, 1, 104802, 1692);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここで少し\n休んだら\nまたバイトよ！", 1, 3, 2, 104802, 1693);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これを内職で\n作ったら\n儲かるかしら？", 1, 3, 3, 104802, 1694);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仕事から帰ってきて\nこういうのがあると\n素敵ね", 1, 3, 4, 104802, 1695);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "しっかり身体を\n温めて、血流を\nよくしなくっちゃ", 1, 3, 5, 104802, 1696);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これで休憩中も\n無駄なく\n鍛えられるわ♪", 1, 3, 6, 104802, 1697);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐ…よく\n食べて、よく働く！\nそれが私のモットーよ", 1, 3, 7, 104802, 1698);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "日々絶えず学んで\n生活に活かすのよ！", 1, 3, 8, 104802, 1699);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1, 1, 1, 104901, 1701);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1, 1, 2, 104901, 1702);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1, 1, 3, 104901, 1703);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "くんくん、\n弟くんのにおい…\n近くにいるね？", 1, 1, 4, 104901, 1704);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1, 1, 5, 104901, 1705);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "この部屋を、\n私と弟くんの\n愛の巣に…", 1, 1, 101, 104901, 1706);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "はぁ～…弟くん\n禁断症状だよ～", 1, 1, 102, 104901, 1707);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 1, 2, 1, 104901, 1708);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 1, 2, 2, 104901, 1709);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "姉と弟の外出は\nデートって\nいうのかな？", 1, 2, 3, 104901, 1710);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もう！\nイタズラする子には\nお姉ちゃんチョップ！", 1, 2, 4, 104901, 1711);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "お姉ちゃんが\nぎゅ～ってして\nあげるね♪", 1, 2, 101, 104901, 1712);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 1, 2, 102, 104901, 1713);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 1, 2, 1, 104901, 1714);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "出かけるなら\n明るいうちに\n帰ってくるんだよ！", 1, 2, 2, 104901, 1715);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "まだ起きてるの？\nそれじゃあ、\nお姉ちゃんも\n夜更かししちゃお☆", 1, 2, 3, 104901, 1716);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "きれいなお姉ちゃん\n好きだよね♪", 1, 3, 1, 104901, 1717);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 1, 3, 2, 104901, 1718);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\nお姉ちゃんチョップ！", 1, 3, 3, 104901, 1719);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この香り、\n弟くん好きかな？", 1, 3, 4, 104901, 1720);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ、弟くんみたいに\nあったかいね～", 1, 3, 5, 104901, 1721);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 1, 3, 6, 104901, 1722);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、これ\n弟くんが好きな\n味付けだね！", 1, 3, 7, 104901, 1723);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんが読んでいいか\nお姉ちゃんが先に\n中を確認しなくちゃ！", 1, 3, 8, 104901, 1724);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1, 1, 1, 104902, 1726);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1, 1, 2, 104902, 1727);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんのお友達は\nみんな私の妹だよ♪", 1, 1, 3, 104902, 1728);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1, 1, 4, 104902, 1729);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はっ！\n弟くんが困ってる\n気がする！", 1, 1, 5, 104902, 1730);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "はぁ～…弟くん、\n禁断症状だよ～", 1, 1, 101, 104902, 1731);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1, 1, 102, 104902, 1732);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姉ちゃん\nキミのお願いなら\nなんでも聞いて\nあげちゃうぞっ", 1, 2, 1, 104902, 1733);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 1, 2, 2, 104902, 1734);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姉ちゃんの胸に\n飛び込んでおいでっ♪", 1, 2, 3, 104902, 1735);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 1, 2, 4, 104902, 1736);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 1, 2, 101, 104902, 1737);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お風呂にする？\nごはんにする？\nそれとも…うふふ♪", 1, 2, 102, 104902, 1738);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 1, 2, 1, 104902, 1739);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お姉ちゃんが\nお昼ごはん\n作ってあげようか？", 1, 2, 2, 104902, 1740);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "眠れないの？\nお姉ちゃんが子守歌\n歌ってあげるね！", 1, 2, 3, 104902, 1741);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんを\n誘惑しちゃうぞ～♪", 1, 3, 1, 104902, 1742);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 1, 3, 2, 104902, 1743);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "かわいい♪\nお姉ちゃんチョップ！", 1, 3, 3, 104902, 1744);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お肌に潤いが\nでてきたみたい～♪", 1, 3, 4, 104902, 1745);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ、弟くんみたいに\nあったかいね～", 1, 3, 5, 104902, 1746);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ダイエットダイエット\nきれいなお姉ちゃんに\nならなくちゃ", 1, 3, 6, 104902, 1747);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんの手作りなら\nもっとおいしくなると\n思うんだけどなぁ～", 1, 3, 7, 104902, 1748);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "弟くんをきちんと\n教育するために\nお姉ちゃんは勉強を\nかかさないのだ☆", 1, 3, 8, 104902, 1749);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん～、エレガントで\n大人なお部屋ね！\nアタシにぴったり！", 1, 1, 1, 105001, 1751);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身長とバスト以外は\n完璧な大人\nなのになぁ～", 1, 1, 2, 105001, 1752);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アタシの大人コーデで\nあいつも夢中ね♪", 1, 1, 3, 105001, 1753);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "朝顔の観察したら\n理系女子になれる\nかしら？", 1, 1, 4, 105001, 1754);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1, 1, 5, 105001, 1755);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "大人っぽい子が\n多いわね…アタシも\n負けてられないわ！", 1, 1, 101, 105001, 1756);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "アタシが待ってる\nなんて、アイツは\n幸せものよねー", 1, 1, 102, 105001, 1757);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "わーい、アメだー♪\n食べる食べるー♪", 1, 2, 1, 105001, 1758);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "熱いハニーラテが\n飲みたーい！\n淹れてー淹れてー！", 1, 2, 2, 105001, 1759);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なによ？　もしかして\n好きな子にイタズラ\nしたくなるってやつ？", 1, 2, 3, 105001, 1760);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ、\nデザインとかの話よ！", 1, 2, 4, 105001, 1761);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 1, 2, 101, 105001, 1762);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 1, 2, 102, 105001, 1763);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝のスキンケアは\n大事なの！", 1, 2, 1, 105001, 1764);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お腹すいたー\nダイエット\nやめちゃおうかなー", 1, 2, 2, 105001, 1765);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "エイジングケアを\nしないとねー", 1, 2, 3, 105001, 1766);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この角度のほうが\n大人っぽく見えるかな\nそれともこっちかしら", 1, 3, 1, 105001, 1767);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 1, 3, 2, 105001, 1768);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "か、かわいい♪　けど\n大人はこんなもの…\nでも、かわいいし～！", 1, 3, 3, 105001, 1769);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "オシャレ～♪\n大人なレディって\n感じよね♪", 1, 3, 4, 105001, 1770);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったかーい♪\nここで宿題\nしようかしら？", 1, 3, 5, 105001, 1771);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動したら成長\nしないかしら？\n背とか胸とか…", 1, 3, 6, 105001, 1772);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "食べすぎると\n太っちゃうな…\nでも、おいしいし～っ", 1, 3, 7, 105001, 1773);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 1, 3, 8, 105001, 1774);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "レディは、どんな時も\nおしとやかに…って\nアタシも騒ぎたいー！", 1, 1, 1, 105002, 1776);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "恋人にするなら\nイケメンか\nただイケよね～", 1, 1, 2, 105002, 1777);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もう少し背が欲しいな\n…もっと牛乳を\n飲まなくちゃ！", 1, 1, 3, 105002, 1778);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "朝顔の観察したら\n理系女子になれる\nかしら？", 1, 1, 4, 105002, 1779);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こ、これは補習の\nお知らせプリント！\nアイツに見つかる前に\n隠さなくちゃ！", 1, 1, 5, 105002, 1780);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "アイツおっそいなー\n別に会いたいわけじゃ\nないけど…\n来ないと気になる…", 1, 1, 101, 105002, 1781);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "アタシが待ってる\nなんて、アイツは\n幸せものよねー ", 1, 1, 102, 105002, 1782);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なーに？\nアタシに甘えたいの？", 1, 2, 1, 105002, 1783);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アタシに合う服\n雑誌で探そうっと！\nサイズじゃないわ\nデザインとかの話よ！", 1, 2, 2, 105002, 1784);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "頭撫でないで！\nお子様みたいに\nあつかわないでって\n言ってるのに～！", 1, 2, 3, 105002, 1785);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "壁ドンの練習…\nあれ？　壁ドンって\n男がするんだっけ？", 1, 2, 4, 105002, 1786);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "ねーねー！\nアタシ、かわいい？\nかわいいわよね？", 1, 2, 101, 105002, 1787);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "これから出かけるの？\nしっかりアタシを\nエスコートしてね！", 1, 2, 102, 105002, 1788);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "レディの朝は\n忙しいのよ", 1, 2, 1, 105002, 1789);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お腹すいたー\nダイエット\nやめちゃおうかなー", 1, 2, 2, 105002, 1790);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "エイジングケアを\nしないとねー", 1, 2, 3, 105002, 1791);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身だしなみチェック\nオッケー！　これで\nいつアイツが来ても\n大丈夫ね！", 1, 3, 1, 105002, 1792);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ！　これ雑誌で\n見たことあるわ～\nだからきっと\nオシャレなのよ！", 1, 3, 2, 105002, 1793);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あたしがもっと\nオシャレにかわいく\nしてあげようか？", 1, 3, 3, 105002, 1794);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "オシャレ～♪\n大人なレディって\n感じよね♪", 1, 3, 4, 105002, 1795);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったかーい♪\nここで宿題\nしようかしら？", 1, 3, 5, 105002, 1796);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動したら成長\nしないかしら？\n背とか胸とか…", 1, 3, 6, 105002, 1797);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "レディは、食べ物にも\n気を使うのよ", 1, 3, 7, 105002, 1798);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おもしろーい！\n…でも絵本って\n子供っぽいかしら？", 1, 3, 8, 105002, 1799);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "魔法と科学\nどっちも極めて\nみせるわ", 1, 1, 1, 105101, 1801);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仕事も片付いたし\n部屋で\n実験実験…♪", 1, 1, 2, 105101, 1802);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "たまった治療代の\n請求書を\nまとめないと…", 1, 1, 3, 105101, 1803);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "新薬が出来たし\nすぐに試したいけど…\n実験台がいないわ", 1, 1, 4, 105101, 1804);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋にこもりすぎると\n曜日の感覚が\nなくなるわね", 1, 1, 5, 105101, 1805);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あの子の記憶を\n取り戻せる薬…\n作れないものかしら", 1, 1, 101, 105101, 1806);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1, 1, 102, 105101, 1807);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あら、ヒマなら\n薬草の整理を\n手伝って", 1, 2, 1, 105101, 1808);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もしかして実験に\n付き合ってくれるの？\nえ？　違う？", 1, 2, 2, 105101, 1809);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "具合が悪い？\nなら診てあげる\nまずは触診から…", 1, 2, 3, 105101, 1810);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "植物に興味あるの？\nなら教えてあげるわ\n色々とね…", 1, 2, 4, 105101, 1811);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 1, 2, 101, 105101, 1812);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 1, 2, 102, 105101, 1813);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "お昼までに調合用の\n花を集めたいの\n手伝ってくれる？", 1, 2, 1, 105101, 1814);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "あら、もうお昼？\nそろそろ一息\n入れましょうか", 1, 2, 2, 105101, 1815);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "夜も更けて来たわね\n私は朝まで実験だけど\n見学していく？", 1, 2, 3, 105101, 1816);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "医者たるもの\nいつだって\n清潔に…♪", 1, 3, 1, 105101, 1817);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いいわねこれ\n仮眠の時に\n使わせてもらうわ", 1, 3, 2, 105101, 1818);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぬいぐるみなら\n動物も…", 1, 3, 3, 105101, 1819);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り…\n仕事場にも\n置いてみようかしら", 1, 3, 4, 105101, 1820);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここにいると\nついウトウト\nしちゃうわ…", 1, 3, 5, 105101, 1821);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "座ってる時間が多いと\n運動不足になるし\nたまにはいいわね", 1, 3, 6, 105101, 1822);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "研究していると\nつい食べるのを\n忘れちゃうのよね", 1, 3, 7, 105101, 1823);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "実験もいいけど\nいつか成果を\n本にしないと…", 1, 3, 8, 105101, 1824);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "徹夜はツラいけど\n集中すると時間の\n感覚がなくなって…", 1, 1, 1, 105102, 1826);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "痛みに悶える顔って\nどうしてあんなに\n興奮するのかしら？", 1, 1, 2, 105102, 1827);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "彼に罵られたら\nどんな気分かしら\n意外と快感かも？", 1, 1, 3, 105102, 1828);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "毒を薄めると\n薬になるのって\n今でも不思議だわ", 1, 1, 4, 105102, 1829);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "綺麗なバラには\nトゲがあるけど\n魅力の一つよね", 1, 1, 5, 105102, 1830);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "カレをさりげなく\n惚れさせる方法を\n研究するわよ…♪", 1, 1, 101, 105102, 1831);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "好意に気づいて貰える\n薬って、どうすれば\n作れるのかしら", 1, 1, 102, 105102, 1832);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "構って欲しいの？\nじゃあ、君の体を\n調べさせて？", 1, 2, 1, 105102, 1833);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "実験に付き合って\n大丈夫よ、試すのは\nただの栄養剤だから", 1, 2, 2, 105102, 1834);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "欲しい薬が\nあったら言ってね\n調合してみるから", 1, 2, 3, 105102, 1835);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おしおきされたいの？\nキミにだったら\nいつでもしてあげる", 1, 2, 4, 105102, 1836);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "キミの傍にいるだけで\n高揚しちゃうのは\n何故かしら…？", 1, 2, 101, 105102, 1837);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私はおしおきする\n側のことが多いけど…\nキミにはされたいかも", 1, 2, 102, 105102, 1838);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝しか取れない\n植物があるの\n採取しに行くわよ", 1, 2, 1, 105102, 1839);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼時ってやけに\n眠たくなるわよね\n…調べたくなるわ", 1, 2, 2, 105102, 1840);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "今日くらいは\nゆっくり眠りたいわ\n…キミと一緒にね", 1, 2, 3, 105102, 1841);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身なりについて\n研究するのも\n楽しそうね", 1, 3, 1, 105102, 1842);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "休息に必要な道具は\n妥協せずに選ぶ！\nこれだけは譲れないわ", 1, 3, 2, 105102, 1843);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "たまにはこういう\n可愛らしいものに\n触れないとね♪", 1, 3, 3, 105102, 1844);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り…\n仕事場にも\n置いてみようかしら", 1, 3, 4, 105102, 1845);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仕事がなかったら\nこのまますーっと\n眠りたいのに…", 1, 3, 5, 105102, 1846);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "運動しないと\n体型の維持が…", 1, 3, 6, 105102, 1847);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "適度な食事も\n大切よね", 1, 3, 7, 105102, 1848);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "まさか私が\n恋愛読本を読む\n日が来るなんて…", 1, 3, 8, 105102, 1849);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぺっぺっ！\n…い、いけないっ！", 1, 1, 1, 105201, 1851);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いっけな～い！\nひづめで床に傷が！", 1, 1, 2, 105201, 1852);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "太っちゃったかも～！\n伐採でダイエット\nしなくっちゃ！", 1, 1, 3, 105201, 1853);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "きちんと生活すると\n毛づやが良くなる\nみたいなのよね～", 1, 1, 4, 105201, 1854);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "みんな、体重\nどれくらいなのかな？", 1, 1, 5, 105201, 1855);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1, 1, 101, 105201, 1856);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "いつか人間の女の子\nみたいなデート、\nしてみたいな～♪", 1, 1, 102, 105201, 1857);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私ね「どこにでもいる\n普通の女の子」って\n言葉が憧れなんだ～♪", 1, 2, 1, 105201, 1858);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "チャームポイント？\n自分では分からない\nけど…まつげかなぁ？", 1, 2, 2, 105201, 1859);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "リマリマ～♪\nはっ！？\nわ、私ったら今何を？", 1, 2, 3, 105201, 1860);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "力仕事ならまかせて！", 1, 2, 4, 105201, 1861);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 1, 2, 101, 105201, 1862);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 1, 2, 102, 105201, 1863);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1, 2, 1, 105201, 1864);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ランチは\nおしゃれなカフェで\nしてみたいな～♪", 1, 2, 2, 105201, 1865);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お肌のケアに\nパックしながら\n寝ようかな～", 1, 2, 3, 105201, 1866);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "やだっ、\nまた寝ぐせついてる！\n直さないと！", 1, 3, 1, 105201, 1867);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミシッっていった！\n私、重すぎるかも！？", 1, 3, 2, 105201, 1868);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ！　あなたも\n美人さんね～♪", 1, 3, 3, 105201, 1869);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ、まったり…\n四足歩行しちゃい\nそうだわ…", 1, 3, 4, 105201, 1870);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あったか～い♪\n…私、毛皮だから\n暑すぎるかも", 1, 3, 5, 105201, 1871);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "な、なんだか野生に\n帰っちゃいそう！", 1, 3, 6, 105201, 1872);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぱくぱく、もぐもぐ、\nぺっぺっ…\nやだ、はしたない！", 1, 3, 7, 105201, 1873);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 1, 3, 8, 105201, 1874);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "素敵ね～、居るだけで\n女子力があがりそうな\nお部屋だわ～", 1, 1, 1, 105202, 1876);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私、大丈夫かしら？\n他の子に怖がられたり\nしないかな…？", 1, 1, 2, 105202, 1877);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "動物苑…って\n嫌なギルド名ね…", 1, 1, 3, 105202, 1878);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "好き、嫌い、好き…\nあっ！　うっかりして\n花占いのお花\n食べちゃった！", 1, 1, 4, 105202, 1879);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここ、女の子らしい\nものでいっぱいね～！\nときめいちゃうわ～♪", 1, 1, 5, 105202, 1880);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "体力なら自信\nあるんだけど…\n恋にはちょっぴり\n臆病になっちゃう", 1, 1, 101, 105202, 1881);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あの人が\n来てくれるまで薪割り\nでもしてよっかな？", 1, 1, 102, 105202, 1882);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "一緒にお出かけ？\nうれしいけど…\n心の準備が！\nはわわわ！", 1, 2, 1, 105202, 1883);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうしたの？\n急に抱きついてきて…\n癒されたいの？", 1, 2, 2, 105202, 1884);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぺっぺっ！\n…い、いけないっ！", 1, 2, 3, 105202, 1885);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "メタモルアップルを\nここで食べたら、\nみんな驚くわよね", 1, 2, 4, 105202, 1886);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "しょうがないなあ、\nこんなにモフらせるの\nあなただけだよ？", 1, 2, 101, 105202, 1887);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "人間になりたいな～\nそれか、あなたが\n私みたいな姿に…♪", 1, 2, 102, 105202, 1888);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "今朝は寝癖がひどいわ\nしっぽの辺りとか～", 1, 2, 1, 105202, 1889);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ダイエット中だから\nお昼は抜いてるの～", 1, 2, 2, 105202, 1890);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お肌のケアに\nパックしながら\n寝ようかな～", 1, 2, 3, 105202, 1891);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ちゃんとかわいく\nしてないと刈られ…\n狩られちゃうもんね！", 1, 3, 1, 105202, 1892);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ミシッっていった！\n私、重すぎるかも！？", 1, 3, 2, 105202, 1893);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ！　あなたも\n美人さんね～♪", 1, 3, 3, 105202, 1894);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り～\n森の中にいるみたいに\nとっても落ち着く～", 1, 3, 4, 105202, 1895);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "素敵～♪　…\nきゃっ！　私の毛が\nたいへんなことに～！", 1, 3, 5, 105202, 1896);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "な、なんだか野生に\n帰っちゃいそう！", 1, 3, 6, 105202, 1897);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "何を食べるかより\n誰と食べるかが\n大事なのよね", 1, 3, 7, 105202, 1898);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "きゃーーー！\nこの恋愛小説\nとっても\nドキドキしちゃう～", 1, 3, 8, 105202, 1899);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ヴァイスフリューゲル\nを盛り上げる方法、\n共に語らおう！", 1, 1, 1, 105301, 1901);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私は子供ではない…！\nが、お菓子は\nいただこう！", 1, 1, 2, 105301, 1902);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋はきちんと\n片づけておかなくては\n部屋の汚れは\n心の汚れだ", 1, 1, 3, 105301, 1903);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "むむむ…明日\n目が覚めたら、身長が\n伸びていないものか…", 1, 1, 4, 105301, 1904);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1, 1, 5, 105301, 1905);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あいつとの新たな\n鍛錬が\n待ち遠しいな…！", 1, 1, 101, 105301, 1906);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "最近、あいつと\n過ごしていて、毎日が\n充実しているな…", 1, 1, 102, 105301, 1907);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "軍人の本分は日々の\n研鑽にあるからな。\n今日も鍛錬に\n行かないか？", 1, 2, 1, 105301, 1908);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 1, 2, 2, 105301, 1909);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "貴公にも、飴をくれて\nやろうか？\nあまいぞ～！\n美味しいぞ～！", 1, 2, 3, 105301, 1910);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私ともっと高く、\n共に飛ぼう！", 1, 2, 4, 105301, 1911);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "貴公は、本当に頼りに\nなる男だな…いや、\nふとそう思っただけだ", 1, 2, 101, 105301, 1912);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "貴公と共にいられる\nことは私の喜びだ。\nこれからも\nよろしく頼むぞ", 1, 2, 102, 105301, 1913);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "うむ、いい朝だ。\n本国の夜明けを\n思い出してしまうな！", 1, 2, 1, 105301, 1914);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "そろそろ昼食に\nするか。腹が減っては\n戦はできないからな", 1, 2, 2, 105301, 1915);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ふわああ…私は子供\nではないが…眠い時は\n眠いのだ…", 1, 2, 3, 105301, 1916);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身だしなみは、心の\n在りようを映すから\n気をつけなくてはな", 1, 3, 1, 105301, 1917);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 1, 3, 2, 105301, 1918);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 1, 3, 3, 105301, 1919);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このともし火、戦いに\n明け暮れる我らの心を\n癒すものだな…", 1, 3, 4, 105301, 1920);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 1, 3, 5, 105301, 1921);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うおおおおおっ！\n鍛錬、鍛錬、\n鍛錬っ！！", 1, 3, 6, 105301, 1922);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いつ戦いになっても\n困らぬように、\n腹八分目に\nしておくのだ！", 1, 3, 7, 105301, 1923);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これを読んで、新たな\n戦術を編み出すぞっ！", 1, 3, 8, 105301, 1924);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "たまには掃除でも\nするか。部屋が\n綺麗になるのは\n喜ばしいことだ", 1, 1, 1, 105302, 1926);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "部屋の中では\n剣を振り回せないのが\n玉に瑕だな…", 1, 1, 2, 105302, 1927);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お菓子が常備されて\nいる部屋。そんな\nものが、私の好みだ…", 1, 1, 3, 105302, 1928);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "毎日牛乳を飲んでいる\nのだが、なかなか背が\n伸びないものだな…", 1, 1, 4, 105302, 1929);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "家庭を守れない者が\n国を守れるはずが\nない。この部屋も\n私が守るぞ！", 1, 1, 5, 105302, 1930);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あいつは今頃、何を\nしているのだろうな…\nふふっ", 1, 1, 101, 105302, 1931);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あいつと会える日が\nこんなにも待ち遠しく\nなるとはな…", 1, 1, 102, 105302, 1932);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "軍人の本分は日々の\n研鑽にあるからな\n今日も鍛錬に\n行かないか？", 1, 2, 1, 105302, 1933);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おお、今日も鍛錬の\n時間だったか！\nすまないな\nすぐ行く！", 1, 2, 2, 105302, 1934);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私は子供ではない！\nが…たまには童心に\n帰りたい時もある…", 1, 2, 3, 105302, 1935);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "貴公にも、飴を\nくれてやろうか？\nあまいぞ～！\n美味しいぞ～！", 1, 2, 4, 105302, 1936);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私と歩きたいのか…？\nそうだな。二人で\n散歩でも行こうか", 1, 2, 101, 105302, 1937);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "貴公と共にいられる\nことは私の喜びだ\nこれからも\nよろしく頼むぞ", 1, 2, 102, 105302, 1938);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "うむ、いい朝だ\n本国の夜明けを\n思い出してしまうな！", 1, 2, 1, 105302, 1939);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "そろそろ昼時だな\n鍛錬の手を緩めて\n昼食にするか", 1, 2, 2, 105302, 1940);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "寝る前に…あと少し\nだけ、鍛錬を…", 1, 2, 3, 105302, 1941);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ヴァイス\nフリューゲルの一員と\nして恥ずかしくないよう\n身なりを整えなくては", 1, 3, 1, 105302, 1942);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふう…軍人たるもの\n常日頃、油断は\nできないのだが…\nお、落ち着くな…", 1, 3, 2, 105302, 1943);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うむ…このかわいさ…\n本国に持って\n帰りたい…", 1, 3, 3, 105302, 1944);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "このともし火\n戦いに明け暮れる\n我らの心を\n癒すものだな…", 1, 3, 4, 105302, 1945);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はあ～、ぽかぽか…\nい、いや！\n気を緩めないぞっ！", 1, 3, 5, 105302, 1946);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うおおおおおっ！\n鍛錬、鍛錬\n鍛錬っ！！", 1, 3, 6, 105302, 1947);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いつ戦いになっても\n困らぬように\n腹八分目に\nしておくのだ！", 1, 3, 7, 105302, 1948);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うむ…脳細胞が\n活性化してきたぞ\n読書は大事だな", 1, 3, 8, 105302, 1949);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私たちの騎空艇\nどんなデザインに\nしよう…？", 1, 1, 1, 105701, 1951);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "団員募集の\nポスター\n作ろうっと♪", 1, 1, 2, 105701, 1952);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "父さん…\n今頃どこで\n何してるんだろ？", 1, 1, 3, 105701, 1953);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "騎空艇に乗って、\n誰もいったことがない\n場所を見つけたいな", 1, 1, 4, 105701, 1954);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "父さん以上の\n世界一の\n騎空士になりたい！", 1, 1, 5, 105701, 1955);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "仲間と行く空の旅…\n何度想像しても\nドキドキするなぁ", 1, 1, 101, 105701, 1956);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "父さん…\n私にもね、大切な\n仲間ができたよ", 1, 1, 102, 105701, 1957);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "仕事の依頼？\nすぐに支度\nしてくるね！", 1, 2, 1, 105701, 1958);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ねえねえ！\n団員募集のポスター\n一緒に作ろうよ！", 1, 2, 2, 105701, 1959);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "なーにー？\nどうしたの？\n今呼んだよね？", 1, 2, 3, 105701, 1960);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今は休憩中だよ？\nだからあなたも\nゆっくりしてて", 1, 2, 4, 105701, 1961);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "私にとってあなたは\nとっても頼りになる、\n自慢の団員だよ！", 1, 2, 101, 105701, 1962);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "お父さんに会えたら、\n大切な仲間として\nあなたを紹介するね！", 1, 2, 102, 105701, 1963);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "おはよう！\n体の調子はどう？\n今日は頑張れそう？", 1, 2, 1, 105701, 1964);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ねえねえ、お昼\n食べに行こうよ！\nお腹空いちゃった", 1, 2, 2, 105701, 1965);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "…あれ？\nおしゃべりしてたら\nもうこんな時間？", 1, 2, 3, 105701, 1966);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうせならオシャレな\n騎空士って\n呼ばれたいな", 1, 3, 1, 105701, 1967);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふぅ、疲れた～…\nちょっとだけ\n休んじゃおっと", 1, 3, 2, 105701, 1968);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "よし！　キミは\n今から団長代理だ！\n…なんてね♪", 1, 3, 3, 105701, 1969);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香り～♪\n気持ちが\n落ち着く～…", 1, 3, 4, 105701, 1970);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これって\n騎空艇に\n置けるかな…？", 1, 3, 5, 105701, 1971);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どんな仕事でも\nこなせるような\n体力がないとね…！", 1, 3, 6, 105701, 1972);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あむっ…うん！\n美味しい～！\n今度作ってみよう♪", 1, 3, 7, 105701, 1973);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "空を冒険するには\n色んなことを\n知っておかないと…", 1, 3, 8, 105701, 1974);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…戻らなくなったよ\nどうすれば元に\n戻る…？", 1, 1, 1, 105702, 1976);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "暇だよ…\nどこかに強い人は\nいないか？", 1, 1, 2, 105702, 1977);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ジョブチェンジ！\n…叫んでも\n戻らないよ", 1, 1, 3, 105702, 1978);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今のうちに、\n魔物退治の\n仕事に行くね！", 1, 1, 4, 105702, 1979);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ハァ～…\nうん、気の巡りは\n問題ないね！", 1, 1, 5, 105702, 1980);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "私の力の源は\n仲間との\n絆だよ！", 1, 1, 101, 105702, 1981);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "いつかこの拳を\n空を越えた、星まで\n届かせたいね", 1, 1, 102, 105702, 1982);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "功夫が足りない人は\nどうすればいいか？\nもちろん修行だよ！", 1, 2, 1, 105702, 1983);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "私はいつも通りに\n喋ってるつもり\nだよ？", 1, 2, 2, 105702, 1984);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "どうした？\nもしかして手合せ\nしたいか？", 1, 2, 3, 105702, 1985);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "騎空士としても\n拳法家としても\n目指すは世界一ね！", 1, 2, 4, 105702, 1986);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "背中はあなたに\n預けたよ！\nよろしくね！", 1, 2, 101, 105702, 1987);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あなたと一緒なら\nきっと、今よりもっと\n強くなれるよ！", 1, 2, 102, 105702, 1988);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "ちゃんと起きてるか？\n寝ぼけてたら\nダメよ？", 1, 2, 1, 105702, 1989);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "腹減ったね…\nなにか食べに\n行くよ！", 1, 2, 2, 105702, 1990);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "修行のしすぎは\n良くないよ？\n気をつけるね", 1, 2, 3, 105702, 1991);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "美しい技は\n美しい体が\nあってこそ！", 1, 3, 1, 105702, 1992);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "よいしょっと…\nちょっとのんびり\nさせてもらうよ", 1, 3, 2, 105702, 1993);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "…練習に\n使うのはさすがに\n可哀そうね", 1, 3, 3, 105702, 1994);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これは…\n瞑想の時にも\n使ってみたいね", 1, 3, 4, 105702, 1995);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "出来ればもっと\n熱いほうが\n嬉しいよ", 1, 3, 5, 105702, 1996);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここでも\n修行出来るなんて\n最高だよ！", 1, 3, 6, 105702, 1997);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "気力の源は体力！\n体力の源は\n健康とご飯！", 1, 3, 7, 105702, 1998);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "んー…\n難しいことは\nわかんないよ！", 1, 3, 8, 105702, 1999);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "わたしたちの\nギルドハウスへ\nようこそ～！", 1, 1, 1, 105801, 2001);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぐるるる～…\nあ、お腹が\n鳴っちゃいました…", 1, 1, 2, 105801, 2002);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ん？\n食べ物のにおい？", 1, 1, 3, 105801, 2003);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "みんなと仲良く食卓を\n囲みたいですね～", 1, 1, 4, 105801, 2004);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋が、わたしの\n帰る場所です♪", 1, 1, 5, 105801, 2005);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あの人を見ると\n胸が満たされます～\nお腹は空いてますが！", 1, 1, 101, 105801, 2006);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あの人、\n大食いの子って\n嫌いかな？", 1, 1, 102, 105801, 2007);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "食べもの、くれるん\nですか？　わーい！\n恋しちゃいそう♪", 1, 2, 1, 105801, 2008);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "つ、つまみ食いなんて\nしてませんよ？\nこれは味見です！", 1, 2, 2, 105801, 2009);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おやつは別腹、\nごはんも別腹、\n魔物も別腹～", 1, 2, 3, 105801, 2010);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "好きなものを、\n好きな人達と食べる！\n最高の贅沢ですね☆", 1, 2, 4, 105801, 2011);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あなたは、\nごはん王子ですね～", 1, 2, 101, 105801, 2012);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "大好きです～\n愛してます～\nえへへ～♪", 1, 2, 102, 105801, 2013);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 1, 2, 1, 105801, 2014);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼ご飯、\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 1, 2, 2, 105801, 2015);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お夕飯も、晩ごはんも\n食べたし…さぁ！\nお夜食の時間ですよ☆", 1, 2, 3, 105801, 2016);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身だしなみ、\n身だしなみ…\nきちんとしないとね♪", 1, 3, 1, 105801, 2017);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ふい～\n消化中です～", 1, 3, 2, 105801, 2018);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしそ…\nか、かわいいです～", 1, 3, 3, 105801, 2019);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いい香りですね～\n空気までおいしそう～\nじゅるり♪", 1, 3, 4, 105801, 2020);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ほっかほか～♪\n魔物の丸焼きが\n作れちゃいますね！", 1, 3, 5, 105801, 2021);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "走って食べて！\n走って食べて！\n\この無限ループです！", 1, 3, 6, 105801, 2022);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いくつでも\n食べられますよ！\n幸せ～☆", 1, 3, 7, 105801, 2023);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "料理の絵を\n見ているだけで、\nよ、よだれが～", 1, 3, 8, 105801, 2024);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋が、わたしの\n帰る場所です♪", 1, 1, 1, 105802, 2026);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ギルドハウス\nどんどん素敵に\nなっていくな～♪", 1, 1, 2, 105802, 2027);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "「やばい」とか\n「おいっす」とか…\n民の言葉って難しい", 1, 1, 3, 105802, 2028);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お菓子の家に\n住みたいな～", 1, 1, 4, 105802, 2029);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あ、頼んでた出前が\n届いたかな？", 1, 1, 5, 105802, 2030);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "大切な人がいて\n大切な場所がある\nすごく幸せです♪", 1, 1, 101, 105802, 2031);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あの人\n大食いの子って\n嫌いかな？", 1, 1, 102, 105802, 2032);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ごはんに行きますか？\n作りましょうか？\n店屋物もいいですね～", 1, 2, 1, 105802, 2033);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "モグモグ…\nあげませんよ～", 1, 2, 2, 105802, 2034);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おやつは別腹\nごはんも別腹\n魔物も別腹～", 1, 2, 3, 105802, 2035);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "好きなものを\n好きな人達と食べる！\n最高の贅沢ですね☆", 1, 2, 4, 105802, 2036);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "大好きです～\n愛してます～\nえへへ～♪", 1, 2, 101, 105802, 2037);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "わたし食べても\n太らないんです♪\nほらほら～触って\nみてくださいよ～", 1, 2, 102, 105802, 2038);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "朝ごはんも終わったし\n早速ブランチを\n食べませんか？", 1, 2, 1, 105802, 2039);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "お昼ご飯\nおいしかったですね～\nそれじゃあ、そろそろ\nおやつにしましょう☆", 1, 2, 2, 105802, 2040);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "お夕飯も、晩ごはんも\n食べたし～。さぁ！\nお夜食の時間ですよ☆", 1, 2, 3, 105802, 2041);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "お姫さまみたいに\nきれいに\nならないと…", 1, 3, 1, 105802, 2042);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "のんびりしていても\nお腹がすいちゃうん\nですよね～", 1, 3, 2, 105802, 2043);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしそ…\nか、かわいいです～", 1, 3, 3, 105802, 2044);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "アップル系、ピーチ系\nオレンジ系…\n香りも色々ですね～", 1, 3, 4, 105802, 2045);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ここでお魚を\n焼けたら\n最高ですね～♪", 1, 3, 5, 105802, 2046);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "身体も鍛えなきゃ～！\nお腹がすいちゃいます\nけど…", 1, 3, 6, 105802, 2047);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "もぐもぐもぐもぐもぐ\nもぐもぐもぐもぐもぐ\nもぐもぐもぐもぐ…", 1, 3, 7, 105802, 2048);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "流行語発表…\nこんな言葉遣いが！\nやばいですね", 1, 3, 8, 105802, 2049);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いろいろ美味しいもの\n食べられるし…\nけっこう幸せかも", 1, 1, 1, 106001, 2051);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "んーー、あたし\nなんで、このギルドに\n入っちゃったんだろ？", 1, 1, 2, 106001, 2052);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "あいつが来たら、\n尾行しなくちゃ♪", 1, 1, 3, 106001, 2053);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋のどこかに、\nあいつの秘密が\n隠されてるかも？", 1, 1, 4, 106001, 2054);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ま、まずいわ…\nギルド活動、\nけっこう楽しい♪", 1, 1, 5, 106001, 2055);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "あいつを監視してる\nと…な、なんか\n変な気分", 1, 1, 101, 106001, 2056);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "主さま…\nだ、誰も聞いてない\nわよね！？", 1, 1, 102, 106001, 2057);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "気まぐれは\nチャームポイント\nみたいなもんよ", 1, 2, 1, 106001, 2058);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うひゃっ！？\nど、どうしてあんたは\nいつも驚かせるのよ！", 1, 2, 2, 106001, 2059);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ぎゃー！\n虫もって近づくなー！", 1, 2, 3, 106001, 2060);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "この部屋って、\n野良猫を拾ってきたら\nだめかな？", 1, 2, 4, 106001, 2061);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (4, 0, 0, "遊びにいくわよ！\nあんたはあたしの\n言うとおりにすれば\nいいの♪", 1, 2, 101, 106001, 2062);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (8, 0, 0, "あんた、あたしに\n操られてみない？", 1, 2, 102, 106001, 2063);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 1, "美食殿としては、\n朝食もこだわらないと\nねぇ～", 1, 2, 1, 106001, 2064);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 2, "ギルド活動だもん！\n美味しいランチを\n食べましょ♪", 1, 2, 2, 106001, 2065);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 3, "ディナーに行くわよ！\nギルドの目的、\n食べ歩きだもんね♪", 1, 2, 3, 106001, 2066);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "今日もしっぽが\nいい感じ♪", 1, 3, 1, 106001, 2067);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "こういう所だと、\n丸くなっちゃうのよね\nうにゃぁ～～", 1, 3, 2, 106001, 2068);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "これ、あたしの能力で\n操れないかな？", 1, 3, 3, 106001, 2069);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "うにゃぁ～♪\nにゃん、にゃお～ん♪", 1, 3, 4, 106001, 2070);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "はぁ～ゴロゴロ\nしたくなるわね", 1, 3, 5, 106001, 2071);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "特訓特訓！\nあたしは\nやればできる！", 1, 3, 6, 106001, 2072);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "おいしいものを\nたくさん食べる…\nギルド活動って\n楽しい～♪", 1, 3, 7, 106001, 2073);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "魔法を使うにも、\n知識が必要だものね", 1, 3, 8, 106001, 2074);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "ま、まずいわ…\nギルド活動\nけっこう楽しい♪", 1, 1, 1, 106002, 2076);
INSERT INTO `v1_4540ce3b86aa3b1e891c2c96ecc5435ecbdb72b4d3b3f98ac8e0cb1e6be778cc` VALUES (1, 0, 0, "いろいろ美味しいもの\n食べられるし…\nけっこう幸せかも", 1, 1, 2, 106002, 2077);
